INSERT INTO `note` (`id`, `creator`, `editor`, `created`, `edited`, `ref_enfant`, `ref_sejour`, `message`)
VALUES
	(1,1,1,'2014-04-29 11:47:49','2014-04-29 11:47:49',383,33,'Recherche trop la présence des jeunes plus âgés et accepte difficilement d\'être recadré dans ce sens. Peut exercer un chantage sentimental.'),
	(2,1,1,'2014-04-29 11:48:36','2014-04-29 11:48:36',307,33,'Aime ne rien faire. Difficile à motiver.'),
	(3,1,1,'2014-04-29 11:52:53','2014-04-29 11:52:53',340,33,'Très motivé au départ du séjour ski. A vite abandonné devant la difficulté du ski. C\'est un point commun avec son frère Dylan et sa sœur Priscilla. Enfant agréable.'),
	(4,1,1,'2014-04-29 12:02:48','2014-04-29 12:02:48',314,33,'Courageux et téméraire au ski. Comportement à risque qui a amené l\'éducateur sportif ESF à prendre des dispositions. Esprit de contradiction. Maintient sa position même si le groupe est unanime pour participer à un projet d\'animation. A besoin de beaucoup de repos au risque de devenir insociable.'),
	(5,1,1,'2014-04-29 12:07:15','2014-04-29 12:35:13',72,33,'A fait l\'objet d\'une discussion préalable. A tenu ses engagements. Séjour irréprochable. Doit être valorisé sur son comportement durant ce séjour. A profité pleinement du programme ski. Très bonne progression.'),
	(6,1,1,'2014-04-29 12:08:20','2014-04-29 12:08:20',275,33,'RAS. Possitif'),
	(7,1,1,'2014-04-29 12:08:48','2014-04-29 12:08:48',516,33,'RAS. Possitif'),
	(8,1,1,'2014-04-29 12:12:06','2014-04-29 12:12:06',518,33,'Bien intégré. Plusieurs demande pour rentrer en contacte avec sa famille. Demande exaucée. Doit être accompagné pour le rangement de sa chambre et de ses affaires. N\'aime pas le ski. préférer les séjours mer.'),
	(9,1,1,'2014-04-29 12:14:18','2014-04-29 12:14:18',471,33,'Hormis des rapports difficiles avec sa sœur enfants très agréable avec l\'équipe d’accueil et les autres jeunes.'),
	(10,1,1,'2014-04-29 12:17:45','2014-04-29 12:17:45',472,33,'Hormis des rapports difficiles avec sa sœur enfants très agréable avec l\'équipe d’accueil et les autres jeunes. De part le fait qu\'elle rapporte auprès des animateurs elle peut être rejeter par les autres jeunes.'),
	(11,1,1,'2014-04-29 12:18:14','2014-04-29 19:48:22',83,33,'RAS. Positif. Adore skier. Très jovial'),
	(12,1,1,'2014-04-29 12:27:35','2014-04-29 12:27:35',526,33,'Aime skier. A su mettre ses connaissances en pâtisserie au service du groupe avec succès. Cherche trop à être valorisé par l\' accomplissement des taches quotidiennes. Enfant très agréable.'),
	(13,1,1,'2014-04-29 12:30:01','2014-04-29 12:31:38',376,33,'RAS. Positif. A profité pleinement du séjour. Séjour entaché par un coup de froid. A du être mis au repos. Ne s’approprie plus les choses qui ne lui appartienne pas.'),
	(14,1,1,'2014-04-29 12:32:01','2014-04-29 12:32:01',350,33,'RAS. Positif'),
	(15,1,1,'2014-04-29 12:48:47','2014-04-29 12:48:47',511,33,'Électrice un groupe. Hyperactif. Tschip les animateurs. Cela a amené l\'équipe à prendre des dispositions et de parler d\'une seul voix. Résultat probant car meilleur 2ème semaine. Chama peut donc entendre. C\'est une hyperactivité pas systématiquement négative car elle amène rarement au conflit. Très bon relationnel avec les autres jeunes. Si prochain séjour vérifier en amont que le trousseau soit complet.'),
	(16,1,1,'2014-04-29 12:49:12','2014-04-29 12:49:12',431,33,'RAS Positif'),
	(17,1,1,'2014-04-29 12:51:41','2014-04-29 12:51:41',367,33,'RAS Positif. Aime skier. Aucun problème d’asthme à signaler. Progression positive de ses rapports avec autrui.'),
	(18,1,1,'2014-04-29 12:52:08','2014-04-29 12:52:08',392,33,'RAS Positif'),
	(19,1,1,'2014-04-29 12:53:20','2014-04-29 12:53:20',539,33,'RAS Positif. A beaucoup apprécié le séjours.'),
	(20,1,1,'2014-04-29 12:55:16','2014-04-29 12:55:16',494,33,'RAS Positif. A enfin fini par sourire à plusieurs reprise. A exprimé sa satisfaction du séjour par un soleil.'),
	(21,1,1,'2014-04-29 12:57:28','2014-04-29 12:57:28',542,33,'RAS Positif. Très discret. Serviable si on le sollicite. De plus en plus détendu au fur et a mesure du séjour.'),
	(22,1,1,'2014-04-29 12:58:45','2014-04-29 19:54:42',287,33,'RAS Positif. A respecté le cadre. Grand changement par rapport au séjour précédent Adore skier et à profité pleinement des séances de ski quotidienne. Infatigable. Honnête : m\'a rendu des chaussures neuve et de marque que je croyais être à lui.'),
	(23,1,1,'2014-04-29 13:13:03','2014-04-29 13:25:51',545,33,'RAS Positif. Aime rire et faire le clown. Donne parfois l\'impression qu\'elle se moque de vous quand on la recadre mais reste une jeune très agréable. Très participative au activités proposées'),
	(24,1,1,'2014-04-29 13:13:31','2014-04-29 13:13:31',362,33,'RAS Positf'),
	(25,1,1,'2014-04-29 13:14:35','2014-04-29 13:14:35',258,33,'RAS Positf'),
	(26,1,1,'2014-04-29 13:23:11','2014-04-29 13:23:11',557,33,'RAS Positif'),
	(27,1,1,'2014-04-29 13:24:58','2014-04-29 13:24:58',170,33,'RAS Positif. N\'a pas skié à cause de ses soucis de santé.'),
	(28,1,1,'2014-04-29 13:31:06','2014-04-29 13:31:06',73,33,'Que du bonheur. Exprime régulièrement le fait qu\'il ne pourras plus venir après la Toussaint 2015. Une très très bonne progression sur le plan de la motricité. A réussi a skier. Précédemment à nager et progression en raquette. Très bon esprit.'),
	(29,1,1,'2014-04-29 13:33:40','2014-04-29 13:33:40',566,33,'Dynamique et sportif. C\'est fait mal au genou au ski. Sans gravité selon les radios et l\'IRM.'),
	(30,1,1,'2014-04-29 13:38:03','2014-04-29 13:38:03',568,33,'Arrive mieux dorénavant à pacifier ses rapports avec autrui. Plus posé. Contact téléphoné avec sa maman fréquent. A eu de la peine à quitter le séjour.'),
	(31,1,1,'2014-04-29 13:40:52','2014-04-29 13:40:52',358,33,'A du être recadré dès les 1er jour du séjour. Puis un bon comportement par la suite. Sameer à la faculté de savoir écouter pour peut qu\'on échange avec lui.'),
	(32,1,1,'2014-04-29 13:45:10','2014-04-29 13:45:10',484,33,'RAS Positif. Bonne participation aux activités proposées. Un peu trop volontaire pour les taches quotidienne. Très agréable.'),
	(33,1,1,'2014-04-29 13:45:44','2014-04-29 21:13:07',571,33,'RAS Positif. A été malade pendant le séjour.'),
	(34,1,1,'2014-04-29 13:51:54','2014-04-29 13:51:54',374,33,'RAS Positif. Adopte une attitude effronté si on le rabroue. Cela ayant été repris. Saad a eu par la suite un comportement exemplaire. De plus en plus souriant au fur et a mesure du séjour.'),
	(35,1,1,'2014-04-29 13:53:32','2014-04-29 13:53:32',375,33,'RAS Positif. Un séjour exemplaire. Nombreux contact téléphoné avec la mère.'),
	(36,1,1,'2014-04-29 13:54:29','2014-04-29 13:54:29',530,33,'RAS  Positif'),
	(37,1,1,'2014-04-29 13:58:12','2014-04-29 13:58:12',93,33,'RAS Positif. Sais parfois se montré insolant mais sais ne pas dépasser les limites . En a conscience. A besoin de se valorisé auprès des autres par ses pitreries. Jeunes néanmoins très agréable'),
	(38,1,1,'2014-04-29 14:21:01','2014-04-29 14:21:01',366,33,'RAS Positif'),
	(39,1,1,'2014-04-29 14:21:27','2014-04-29 14:21:27',364,33,'RAS Positif'),
	(40,1,1,'2014-04-29 14:22:10','2014-04-29 14:22:10',540,33,'Ne semble pas avoir pris plaisir à ce séjour'),
	(41,1,1,'2014-04-29 19:47:25','2014-04-29 19:47:25',54,33,'Cherche à s\'affirmer. N évite pas l\'affrontement. Peut se monter physiquement violent. A mis une claque à un jeunes pour une histoire de prise occupé par son chargeur et une insulte ( Ludovic ). Pour une balle de foot et le mot bouffon ( bradley ). Il a été cantonné dans sa chambre. De toute façon il ne voulaiT pas participer à la boom. Un des 3 jeunes sur 29 (26 soleil ) à avoir exprimé un nuage lors de la fin du séjour. Nolane reste parfois difficile à motiver et n\'aime pas le ski. Précédemment en bord de mer (été 2013 ) il ne c\'était pas baigné. A part ces incidents il sait être agréable.'),
	(42,1,1,'2014-04-29 19:56:22','2014-04-29 19:56:22',544,33,'RAS Positif. Réservé, effacé. A pris plaisir au séjour'),
	(43,1,1,'2014-04-29 19:56:55','2014-04-29 19:56:55',554,33,'N\'est pas venu au séjour.'),
	(44,1,1,'2014-04-29 19:58:36','2014-04-29 19:58:36',555,33,'RAS Positif.  D\'abord dans l\'observation, Il est apparu détendu et jovial au fur et a mesure du séjour.'),
	(45,1,1,'2014-04-29 19:59:46','2014-04-29 20:01:09',482,33,'RAS Positif.  D\'abord dans l\'observation, Il est apparu détendu et jovial au fur et a mesure du séjour. Jeune  très agréable.'),
	(46,1,1,'2014-04-29 20:07:09','2014-04-29 20:07:09',565,33,'RAS Positif. Réticente au début et en retrait elle s\'est détendu au fur et à mesure. Très fragile physiquement elle n\'a pas skier. S\'est tordu la cheville lors d\'une promenade. Participative et volontaire dans les taches quotidiennes. Agréable et souriante. Bien que discrète très bon relationnel avec autrui.'),
	(47,1,1,'2014-04-29 20:18:43','2014-04-29 20:18:43',318,33,'RAS Positif. Sami est intelligent et sensible. Une chute spectaculaire mais sans gravité l\'a marqué, il a su la décrire et en parler. Il a pleuré après le départ d\' Hanen (ados). Il a trouvé son maître dans son camarade de chambré ( même age ) qu\'il a trouvé trop turbulent et agaçant. Sami contrôle mieux son énergie débordante.'),
	(48,1,1,'2014-04-29 20:22:47','2014-04-29 20:22:47',531,33,'N\'est pas venu. Selon Whitney sa sœur c\'est la non possession de son téléphone portable lors de nos séjours qui aurait posé problème. C\'est dommage car les jeunes du groupe ayant vraiment joué le jeu, la fréquence de remise de leur portable a presque été quotidienne.'),
	(49,1,1,'2014-04-29 20:25:24','2014-04-29 21:12:25',572,33,'Electron libre. Manque cruellement de cadre. Un animateur doit être mandaté à sa surveillance. Son plus : possède un bon niveau de ski ce qui a permis de canaliser son énergie pendant le séjour. On aurait été satisfait d\'une forme de prévenance avant le séjour. Peut retrouver sa place parmi nous pour une autre tentative car il est autrement sympathique.'),
	(50,1,1,'2014-04-29 21:19:56','2014-04-29 21:19:56',575,33,'N \'a pas été au bout du séjour. Retour le 22 avril au lieu du 26. N\'a pas su se conformer aux règles.( vu avec Marion son éducatrice et la responsable d\'astreinte de l\'ASE. ) Elle pourrait trouver sa place lors d\'un prochain séjour sous réserve d\'une réunion avec elle même, ses responsables et les membres du gîte car elle n\'a pas été insensible à l\'ambiance du séjour. Elle s\'est braquée prématurément.'),
	(51,1,1,'2014-04-29 21:20:31','2014-04-29 21:20:31',97,33,'RAS Positif'),
	(52,1,1,'2014-04-29 21:26:46','2014-04-29 21:26:46',196,33,'RAS Positif. Est très inquiet de ne plus pouvoir revenir au gîte. M\'a interpellé à ce sujet à plusieurs reprise. La dynamique des séjours du foyer est sans commune mesure avec la notre. Par ailleurs ne plus revoir ses amis du gîte l\'inquiète. Je lui ai promis d\'en faire part à Mr JAPPON.'),
	(53,1,1,'2014-05-05 18:18:37','2014-05-05 18:18:37',533,40,'N\'écoute pas, provocateur, insolence. Réflexion déplacée avec les filles (taches réservées aux filles). A teste le cadre, mais à la fin du séjour, un mieux dans le comportement'),
	(54,1,1,'2014-05-05 18:20:51','2014-05-05 18:20:51',137,40,'samedi - dimanche : difficultés. Peut se battre, se positionne comme n\'étant jamais responsable. Mais a tenu de lundi à jeudi. Vendredi : énervement du à la fin du séjour. Qd on le gronde, il se gonfle, regarde méchamment par en dessous et peut s\'énerver\r\nBilan globalement positif'),
	(55,1,1,'2014-05-05 18:21:58','2014-05-05 18:21:58',53,40,'Se bagarre facilement. Manipulatrice. A tel à son père et à sa famille d\'accueil en utilisant le portable de Prescillia. Relations difficiles avec les garçons et s\'entend bien par contre avec les filles.'),
	(56,1,1,'2014-05-05 18:22:22','2014-05-05 18:22:22',514,40,'ras +'),
	(57,1,1,'2014-05-05 18:22:37','2014-05-05 18:22:37',149,40,'ras +'),
	(58,1,1,'2014-05-05 18:23:36','2014-05-05 18:23:58',506,40,'très sensible. Peut être émue si on crie. Veut être parfaite. Très gentille, s\'attache bcp. Parle parfois comme un bb. Partante pour tout'),
	(59,1,1,'2014-05-05 18:24:14','2014-05-05 18:24:14',550,40,'ras +++'),
	(60,1,1,'2014-05-05 18:25:23','2014-05-05 18:25:23',558,40,'samedi et dimanche : il répondait, rigolait nerveusement. changement radical à partir de lundi. Participatif, attentionné avec les autres (aussi bien enfants - adultes). Souriant ++'),
	(61,1,1,'2014-05-05 18:25:35','2014-05-05 18:25:35',567,40,'ras+'),
	(62,1,1,'2014-05-05 18:25:52','2014-05-05 18:25:52',384,40,'ras +. Peut être influencable'),
	(63,1,1,'2014-05-05 18:26:07','2014-05-05 18:26:15',341,40,'ras +.'),
	(64,1,1,'2014-05-05 18:27:13','2014-05-05 18:27:13',315,40,'Est facilement à l\'écart du groupe pour lire calmement. Va vouloir ne pas participer à certaines activités. Au début du séjour, il faisait le pitre excessivement pour faire rire les autres.'),
	(65,1,1,'2014-05-05 18:31:58','2014-05-05 18:37:11',286,40,'gros mots et insulter les autres. Qd il est repris, attitude insolente (sourire narquois,...) Quand on reprend avec lui ses difficultés, fais comme si il ne comprenait pas. Alimentation : très petit appétit, ne veut pas grossir\r\nProvoque les adultes : va ds les espaces non autorisés, monte sur le babyfoot, prends les jeux sans ok, a cassé mikados. peut mettre en diff. le groupe + équipe. Dde une vigilence accrue et quasi individuelle\r\nVentoline : pas ordonnance. Mme (2x/j) -> a vous de voir, appel 15 si nécessaire. J\'ai décidé de ne rien donné, aucun souci durant tte la sem'),
	(66,1,1,'2014-05-05 18:37:51','2014-05-05 18:37:51',515,40,'ras +. A testé le cadre au début, mais amélioration et  agréable'),
