	(69,1,1,'2014-05-05 18:39:33','2014-05-05 19:14:04',521,40,'violente (a griffé timothé au sang)\r\nmenacante (promesse de giffler une autre fille durant la nuit)\r\nmensonge (peut dire tt et son contraire dans une discussion et maintenir qu\'elle ne l\'a pas dit).\r\nne respecte pas les consignes (espaces privés visites, utilisation des aff des autres) malgré pls discussions + rappels\r\nle sam soir empeche les autres de dormir jsq 00h30 et à 2h30 en train de discuter\r\nAppel de la fam. Ac. dimanche pour connaitre le profil de la jeune.\r\nA dormi 1 nuit séparée des autres.\r\nLundi matin : pince, pousse\r\nAmélioration durant le séjour. Peut être en difficulté ds ctains jeux (pour compter, nain jaune...)'),
