	(76,1,1,'2014-05-05 19:19:41','2014-05-05 19:19:41',548,40,'se fiche de ce qu\'on lui dit. Ne fait que ce qu\'il a envie. Par contre en relation duelle, est agréable. Veut participer à la préparation des repas, vaisselle. Par contre, transgression systématique des règles. N\'écoute pas, peut répondre. Est en parallèle du groupe dans les jeux, pince les autres, crache dessus, insulte. Le groupe le rejetait à la fin de la semaine qd jeux. Peut mettre en difficulté l\'équipe car dde une surveillance accrue et quasi individuelle'),
