	(78,1,1,'2014-06-03 17:23:38','2014-06-03 17:23:38',599,52,'A ete triste (pleurs le vend soir) et renfermée jusqu\'au dimanche où elle a commencé à s\'ouvrir.  N\'a pas voulu échanger avec nous,réponses monosyllabiques. Le vend a parlé à sa maman à 23 h 30 et elle voulait aller dans la chb de valentin, elle refusait de donner son portable. (choix donner ou rester ds sa chb). + proche de val et pas d\'alex (voire rejetante : \"l\'autre gros...\"). très prévenante avec maxime.'),
	(79,1,1,'2014-06-03 17:24:07','2014-06-03 17:25:13',49,52,'gentil avec son petit frère mais parfois le frappe sans raison apparente'),
	(80,1,1,'2014-06-03 17:25:02','2014-06-03 17:25:02',50,52,'très participatif et volontaire pour tous (jeux - taches vie quot\'). très protecteur et maternant avec son petit frère.'),
	(81,1,1,'2014-06-05 11:54:59','2014-06-05 11:54:59',602,52,'a commencé le we très renfermé. a refusé de manger le vend soir. qd j\'ai donné ses médic, j\'ai échangé avec lui, donnant les régles de fonctionnement et limites. lui donnant ses difficultés. S\'est ouvert au tout long du séjour. participatif. s\'est fait un copain (michel)'),
	(82,1,1,'2014-06-16 13:37:56','2014-06-16 13:37:56',601,53,'Manquait le tt d\'urgence (buccolam). Jeune caractérielle. se permet avec les autres mais ne supporte pas qd ils lui font pareil. Finit par céder et obtempérer mais dde bcp de patience et de présence. Difficile à contenir'),
	(83,1,1,'2014-07-10 16:26:15','2014-07-10 16:26:15',561,34,'fait régner une mvaise ambiance et systématiquement dans la moquerie. A manqué et manque de cadrage. Ne supporte et ne respecte pas les consignes. Doit être isolé du groupe et sous surveillance permanente. 2ème sem du séjour compromise'),
