	(102,1,4,'2014-07-13 18:19:25','2014-07-31 22:44:01',645,41,'Séjour interrompu le dimanche 13/7 : appel cadre astreinte pour organiser son retour. Nous avons déposé Nouhoum chez une ass. fam à Clichy sous bois, dimanche midi.\r\nDans le samedi après-midi, Nouhoum s\'est retiré du groupe à plusieurs reprises, se positionnant en victime, sans fondement (les autres n\'auraient pas voulu qu\'il joue, ils se moqueraient). Nous avons détaché un animateur pour discuter avec lui. \r\nLe samedi soir, Nouhoum ne voulait pas dormir. Il voulait faire ce qu\'il voulait, comme il voulait.  Il refusait toute contrainte, se mettant debout dans le lit superposé, voulant descendre, etc. Nous avons mis en place différentes méthodes pour le calmer, en vain. Il insultait les autres jeunes dans la chambre. On l\'a fait descendre au rez-de-chaussée, pour l\'installer pour la nuit. Pour réussir à le contenir dans un espace, 3 adultes. Refus de toute obéissance. Il sautait sur les canapés, chantait, criait, essayait de sortir à l\'extérieur. Si on l\'ignorait, il allait devant les chambres des autres en tapant dans les mains pour les réveiller. Si on le contraignait, il criait, nous provoquait, chantait. Cette situation a duré jsq à 1 h 30. Aucune prise possible. Le lendemain matin, à son réveil, il a recommencé. Il veut aller où il veut, si on l\'empêche, il tente de nous taper avec ses claquettes. Ce comportement étant incompatible avec la vie et le fonctionnement du groupe, nous avons organisé son retour.\r\nPar contre, dès lors qu\'il était installé dans la voiture pour partir, il est resté calme et ce, durant le trajet.'),
	(103,4,4,'2014-07-31 21:49:29','2014-07-31 21:49:29',498,35,'peut être humiliante vis à vis de certains jeunes (Olivia)'),
