	(118,4,4,'2014-07-31 22:51:35','2014-07-31 22:51:35',398,41,'black liste. crises sur crise. impossible de l\'emmener en extérieur : à la moindre contrariété... crise. Dde une présence d\'un animateur.  . Ne respecte pas les consignes. S\'énerve très violemment. Peut être agréable en relation duelle et très serviable. Mais incompatible avec la vie de groupe. A apprécié qd il était écarté du groupe et restait avec 1 ou 2 jeunes. (pb avec son traitement - changement du dosage);'),
	(119,1,4,'2014-08-04 15:40:41','2014-08-05 10:12:28',287,36,'Note d\'incident - Thomas\r\n\r\nLors de son séjour à Bacilly, Thomas a frappé un jeune de 14 ans Robin Scotto le 01 août 2014.\r\n\r\nEn effet, Robin. Pour indication, ce jeune souffre de nanisme et l\'ensemble du groupe spontanément intégré sans discrimination. Cependant, il  a par sa provocation verbale a suscité l\'animosité de l\'ensemble du groupe envers lui. Dans la soirée, il a provoqué de nouveau Thomas qui lui a asséné un coup de poing dans l\'oeil, provoquant un hématome important à l’œil. Nous avons été consulté aux Urgences de l’hôpital où il a été conseillé d\'aller voir un ophtalmo par la suite.\r\n\r\nNous avons pris la décision d\'exclure temporairement Thomas en l\'isolant sur un autre séjour avec des plus jeunes, dans l\'attente de notre échange.\r\n\r\nSuite à notre conversation de ce matin, nous avons convenu de réintégrer Thomas sur le séjour initialement prévu et qui se termine le 23/08. Thomas ayant été averti des remarques faites et décisions prises, il s\'engage  à être irréprochable.'),
	(120,1,1,'2014-08-11 17:05:05','2014-08-11 17:05:05',500,42,'Ils sont tous les deux très agréables, participatifs tant à la vie quotidienne qu’aux activités proposées. Ils sont assez réservés avec les adultes, notamment Aruan. Par contre, cette discrétion n’est pas constatée avec les autres jeunes.'),
	(121,1,1,'2014-08-11 17:05:14','2014-08-11 17:05:14',499,42,'Ils sont tous les deux très agréables, participatifs tant à la vie quotidienne qu’aux activités proposées. Ils sont assez réservés avec les adultes, notamment Aruan. Par contre, cette discrétion n’est pas constatée avec les autres jeunes.'),
	(122,4,4,'2014-09-04 10:21:37','2014-09-04 10:22:11',602,42,'s\'ouvre de plus en plus. A été triste fin de séjour. Douleur thoracique (parce qu\'il pensait à sa maman). Il m\'en a parlé. A perdu les 150 euros. S\'est bien entendu avec les plus petits. A du mal à  participer aux activités'),
	(123,4,4,'2014-10-01 10:09:53','2014-10-01 10:09:53',666,36,'Ne respecte pas les consignes et le cadre, très agité, buté. Mais sympa malgré tout. on n\'obtient pas de résultat malgré le cadre. peut être exclu des tables pour être mis avec les adultes pour l\'avoir en vigilence. Dans les relations avec les autres jeunes, très bien, pas de conflits.'),
	(124,4,1,'2014-10-26 14:11:44','2014-11-06 17:51:20',680,38,'jeune sympathique, partant pour tout et participatif. A pleuré quand il a eu les parents au téléphone. La présence de son frère lui permet d\'accepter la séparation.'),
	(125,4,1,'2014-10-26 14:12:52','2014-11-06 17:52:57',679,38,'jeune sympathique. reconnait le cadre. peut déborder en présence des autres. mais participatif, partant. sportif.\r\nvigilance à avoir quand à l\'argent (peut réclamer aux autres - notamment son petit frère pour ne pas \"casser\" son billet). dans une discussion peut se braquer. Se sent investi de tout pouvoir sur son frère'),
	(126,4,1,'2014-10-26 14:14:03','2014-11-06 17:53:08',518,38,'agréable. met du temps parfois pour connaitre les consignes. veut acheter des bonbons/gateaux pour les autres.\r\nras+'),
	(127,4,4,'2014-10-26 14:15:38','2014-11-07 16:29:29',376,38,'ras+. a été triste le samedi de milieu de séjour. mal des parents. mais plusieurs jeunes manifestaient une tristesse.\r\nA la fin de la 2ème semaine, on a fouillé toutes les valises -> vol du tél de michel chand. avait deux hauts ne lui appartenant pas (dit que c\'est une erreur). par contre, un sweet de Enzo  a été retrouvé dans la valise de David Azevedo qui a dit le trouver chouette; N\'a pas émis de regrets particuliers. Etait embété (par la découverte ?)'),
	(128,4,4,'2014-10-26 14:17:03','2014-10-26 14:17:03',598,38,'ras +; participante, volontaire pour tout. peut être fofolle et crier fort. (comportement ado)'),
