	(130,4,1,'2014-10-26 14:18:20','2014-11-06 18:00:54',515,38,'souvent boudeur. Peut mal parler aux adultes. recadrage le vend 24/10; a eu une crise de nerf  très longue (20 min) : obligé de le contenir, voulait partir, mutique (n\'acceptait pas de participer à la veillée des + jeunes, et voulait être avec les grands). on a été faire un tour pour dehors pour discuter. S\'est bagarré avec d\'autres jeunes à plusieurs reprises. jeu de taper derrière la tete. a du mal à rester en place notamment à table pour les repas.'),
