	(149,4,1,'2014-10-26 15:05:51','2014-11-06 18:19:53',504,38,'parle mal aux adultes, répond. Discussion mercredi, a tenu 4 jours. dimanche a recommencé à être insolant. Nouvelle discussion. a dit ne rien avoir à faire des éduc. je l\'ai prévenu que je téléphonerai lundi au foyer.\r\ndiscussion avec le responsable. le séjour s\'est amélioré, mais david est un jeune avec beaucoup de colère qu\'il a du mal à gérer - mais cherche-t-il vraiment à se controler ?. (nombreux conflits avec Mounia).'),
	(150,4,1,'2014-10-27 11:35:47','2014-11-06 18:10:58',709,38,'appel mme dim matin / soir, lundi matin. propos tenus svt négatifs sur la jeune (difficile, ne fait qu\'à sa tete, veut faire sa grande... valise qu\'elle aurait faite seule, mériterait une fessée pour avoir oublié ses tee shirts, a du emmener son livre de lecture -> à faire durant les vacances, si elle ne l\'a pas pris, lui dire qu\'elle se fera grondée au retour). mme a tél prsq ts les jours, propos et élocution laissant à penser qu\'elle était avinée. Nawel agréable mais à surveiller car elle a tendance à jouer \"limite\" avec les autres (chahut avec les mains, peut frapper avec un torchon, mais tjs sous prétexte du jeu).'),
	(151,4,4,'2014-11-02 18:25:41','2014-11-02 18:55:19',8,37,'Yassine Askri a participé en 2014 à un séjour bord de mer du vert et du bleu du 09 au 23 août 2014 en Normandie, à un séjour multi-activité et deux weekend en Picardie. Entouré d\'une dizaine de jeune de son age, le groupe était énergique et participatif. néanmoins les séjours sont ponctué de beaucoup de railleries et d\'insultes entre jeunes, notamment au moment des repas.'),
	(152,4,4,'2014-11-02 18:34:47','2014-11-02 18:34:47',8,55,'Des difficultés à modérés ses propos lors de disputes avec d\'autres jeunes. N\'adopte pas une attitude apaisante et relance le conflit.'),
	(153,4,4,'2014-11-02 18:41:22','2014-11-02 18:41:22',8,57,'Première bravade verbale avec moi même en fin de séjour court suite à un conflit avec d\'autres jeunes.'),
	(154,4,4,'2014-11-04 17:23:12','2014-11-04 17:23:12',711,38,'jeune très angoissé. dans sa relation à l\'adulte, on sent un fragile équilibre, impression qu\'il peut exploser très facilement. mais quand on lui demande quelque chose, essaye d\'esquiver mais finit par faire'),
	(155,1,1,'2014-11-06 17:50:45','2014-11-06 18:06:42',640,38,'énurétique. Cachait en faisant son lit très bien. n\'aime pas prendre son traitement.jeune discrète mais participative à toutes les activités'),
	(156,1,1,'2014-11-06 17:57:29','2014-11-06 17:57:29',374,38,'a été dans l\'ensemble'),
	(157,1,1,'2014-11-06 17:57:42','2014-11-06 17:57:42',683,38,'ras +'),
	(158,1,1,'2014-11-06 18:01:31','2014-11-06 18:02:02',384,38,'ras +. ne se met jms en colère mais si on a volé un vêtement (sweet)'),
	(159,1,1,'2014-11-06 18:02:59','2014-11-06 18:02:59',450,38,'ras +. toujours difficile quand il ne veut pas participer à une activité. angoissé par ses études, veut toujours travailler et réviser'),
	(160,1,1,'2014-11-06 18:05:02','2014-11-06 18:05:30',628,38,'ras ++; jeune agréable, a du mal au début à s\'autoriser à participer aux activités. préfère les activités en petits groupes. attentionnée, toujours prête à donner un coup de main.'),
	(161,1,1,'2014-11-06 18:05:51','2014-11-06 18:05:51',629,38,'ras ++; jeune très agréable, bien intégré'),
	(162,1,1,'2014-11-06 18:07:22','2014-11-06 18:07:22',281,38,'ras +; a pu se montrer renfrognée  et fermée sans vouloir dire pourquoi'),
	(163,1,1,'2014-11-06 18:07:37','2014-11-06 18:07:37',425,38,'ras+'),
	(164,1,1,'2014-11-06 18:07:51','2014-11-06 18:07:51',426,38,'ras +'),
	(165,1,1,'2014-11-06 18:08:05','2014-11-06 18:08:05',196,38,'ras+'),
	(166,1,1,'2014-11-06 18:08:22','2014-11-06 18:08:22',704,38,'pas venu'),
	(167,1,1,'2014-11-06 18:11:25','2014-11-06 18:11:25',350,38,'ras +'),
	(168,1,4,'2014-11-06 18:13:11','2014-11-12 10:25:51',712,38,'peut avoir une attitude insolente. a voulu frapper une autre jeune, qd l\'animatrice s\'est interposée, ne sert pas arrêter et a bousculé l\'adulte. a mal parlé alors, mais après coup, est revenue spontanément s\'excuser. agréable et participe facilement pour aider.'),
	(169,1,1,'2014-11-06 18:13:57','2014-11-06 18:13:57',370,38,'ras+; a cassé en shootant dans des cailloux, la vitre du minibus. était très embété et s\'est excusé plusieurs fois'),
	(170,1,1,'2014-11-06 18:14:48','2014-11-06 18:15:23',53,38,'difficile. crises quotidiennement. se bagarre, cherche les autres. peut se mettre à crier, se calme tout aussi rapidement qu\'elle s\'énerve. on a été obligé de la mettre régulièrement à l\'écart des autres jeunes pour apaiser la situation.'),
	(171,1,1,'2014-11-06 18:16:38','2014-11-06 18:16:38',471,38,'peut créer des histoires avec les autres jeunes (coalition avec les autres contre qqun). difficile relation avec sa soeur.'),
	(172,1,1,'2014-11-06 18:16:39','2014-11-06 18:16:39',471,38,'peut créer des histoires avec les autres jeunes (coalition avec les autres contre qqun). difficile relation avec sa soeur.'),
	(173,1,1,'2014-11-06 18:16:52','2014-11-06 18:16:52',472,38,'ras+'),
	(174,1,1,'2014-11-06 18:18:15','2014-11-06 18:18:15',616,38,'jeune difficile. se mure dans un silence, derrière ses mains, baissant la tête, refusant de parler quand on la reprend sur qqchose. dit des gros mots. parle mal, meme avec les plus grands.'),
	(175,1,1,'2014-11-06 18:19:10','2014-11-06 18:19:10',715,38,'préfère avec les plus jeunes. retard ? jeune agréable et participatif (activités + vie quot\')'),
	(176,1,1,'2014-11-06 18:20:08','2014-11-06 18:20:08',358,38,'ras +'),
	(177,1,1,'2014-11-24 14:17:26','2014-11-24 14:17:26',286,58,'tjrs vigilence mais en posant un cadre strict et constant, ca a été dans l ensemble'),
	(178,1,1,'2014-11-24 14:25:51','2014-11-24 14:25:51',93,59,'a émis le désir de ne plus venir durant les week-end'),
	(179,1,1,'2015-02-21 21:29:01','2015-02-21 21:29:01',683,78,'énurétique. Très jovial. Partant pour tout.'),
	(180,1,1,'2015-02-21 21:31:17','2015-02-21 21:31:17',756,78,'demande beaucoup d\'attention. Veut toujours tout faire. A besoin d\'être rassuré. Je m\'interroge sur comment enzo  arriverait à se situer dans un grand groupe. Perdu ? Serait certainement triste face à la frustration (et manque d\'attention). Retard ?'),
	(181,1,1,'2015-02-21 21:31:34','2015-02-21 21:31:34',757,78,'ras +++'),
	(182,1,1,'2015-02-21 21:34:57','2015-03-16 15:18:28',761,78,'ne voulait pas venir au départ. 1ère semaine s\'est très bien passée. un peu taciturne - raconte des histoires tjrs négatives ou violentes. S\'est détendu au fil des jours (groupe très petit, bienveillant et sympa). Intéressé par les activités notamment en relation privilégiée. Par contre, refuse de reconnaitre qu\'il s\'amuse ou qu\'il a passé à bon moment. Sourit mais si il sent un regard sur lui, se referme.\r\nQuid de la 2ème sem avec un groupe plus grand et + âge ?\r\nRelation plus compliquée. Se met à l\'écart pour manger. Raconte des histoires abracadabrantes que les autres jeunes ne croient pas --> léger rejet (poisson pêché de 2 m, construction d\'une maison en mosaique de 2 m...). A parlé beaucoup de l\'éduc Marie.  Si il ne veut pas participer, ne fais pas d\'efforts. A reçu un courrier, après l\'avoir lu, l\'a déchiré disant qu\'il n\'en avait rien à faire.'),
	(183,1,1,'2015-03-03 12:22:41','2015-03-03 12:24:31',736,78,'Léo ment systématiquement, même pris sur le fait (je l\'ai vu mettre un grand coup d\'épaule dans la porte des wc pour embêter un jeune à l\'intérieur, il a nié farouchement disant qu\'il avait juste gratté la porte avec son doigt). Il a caché un tél portable + mp3 alors qu\'on lui avait ddé si il en avait. Peut répondre aux adultes mais obtempère facilement. Il se moque des autres jeunes. Léo se montre participatif aux activités et aux temps de la vie quot.'),
	(184,1,1,'2015-03-03 12:26:46','2015-03-03 16:55:58',744,78,'ne participe pas aux veillées. est souvent dans une attitude de plainte (s\'est plaint du ventre. le papa nous avait averti et donné du smecta - sans ordonnance). Douleurs abdo le samedi soir et dimanche matin (angoisse ?). recherche la présence des adultes.\r\nfait bcp référence (comme son frere et sa soeur) à sa maman (pour la préparation des plats) et disant qu\'elle travaillait bcp'),
	(185,1,1,'2015-03-03 12:30:17','2015-03-03 16:56:32',745,78,'agréable. relations avec sa soeur difficiles. participante aux activités et temps de la vie quot\'\r\nfait bcp référence (comme son frere et sa soeur) à sa maman (pour la préparation des plats) et disant qu\'elle travaillait bcp'),
	(186,1,1,'2015-03-03 12:30:31','2015-03-03 16:56:49',746,78,'ras ++\r\nfait bcp référence (comme ses soeurs) à sa maman (pour la préparation des plats) et disant qu\'elle travaillait bcp'),
	(187,1,1,'2015-03-03 12:30:56','2015-03-03 12:30:56',505,78,'ras ++ (souriante, agréable, participative à tt)'),
	(188,1,1,'2015-03-03 12:31:38','2015-03-03 12:31:38',749,78,'se moque facilement des autres. agréable et participant.'),
	(189,1,1,'2015-03-03 12:32:34','2015-03-03 12:32:34',758,78,'gentille. veut bien faire. recherche l\'attention et affection des adultes. a fait pipi dans la poubelle des wc et + odeur d\'urine sur elle.'),
	(190,1,1,'2015-03-03 12:33:03','2015-03-03 12:33:03',766,78,'agréable. parle fort. participant.'),
	(191,1,1,'2015-03-03 12:33:17','2015-03-03 12:33:17',44,78,'ras ++'),
	(192,1,1,'2015-03-03 12:40:20','2015-03-03 12:49:58',759,78,'très actif et drole. Demande une vigilence soutenue. Avec adrien c\'est toujours la faute des autres. Raconte des histoires pour obtenir ce qu\'il veut (les feutres sont à lui, les centimes aussi, l\'anim a dit oui alors que non....). Ne se laisse pas faire et peut même se battre (meme avec plus grand).  a du mal à s\'endormir et peut empêcher les autres de dormir. Bisous avec kalvin (voir note dans dossier de kalvin Lefebvre)'),
	(193,1,1,'2015-03-03 12:49:20','2015-03-03 12:55:00',750,78,'jeune à ne pas reprendre. \r\nTrop turbulent. Demande trop de patience et vigilance. n\'écoute pas. Fait ce qu\'il veut. Aucune notion du danger, des limites. Ne respecte pas les consignes / cadre. Tout le temps dans le mouvement. Bisous avec adrien (voir note dans dossier).\r\ndans les activités, peut montrer de la concentration'),
	(194,4,4,'2015-03-03 16:41:36','2015-03-05 16:50:37',374,76,'Très bon séjour. Comportement irréprochable.  Bonne évolution par rapport au séjour précédent.'),
	(195,4,4,'2015-03-03 16:52:16','2015-03-05 18:49:45',740,76,'Fort d\'un début de séjour positif. N\'écoute pas le consignes. Pousse à l\'exaspération des animateurs. Cherche à se valoriser auprès des autres jeunes. Dialogue difficile par une attitude hautaine.  A travailler avec elle avant une futur inscription.'),
	(196,4,4,'2015-03-03 17:03:47','2015-03-03 17:03:47',739,76,'Agréable et participatif.  A envie de profiter pleinement des activités proposées. Peut se braquer lors de consignes mais comprend leur justification dès lors qu\'on prend le temps de les expliquer.'),
	(197,4,4,'2015-03-03 17:15:59','2015-03-03 17:15:59',488,76,'Apprécié de toute l\'équipe d\'accueil. Partant pour toute activité.'),
	(198,4,4,'2015-03-03 17:40:03','2015-03-03 17:41:02',47,76,'Agréable, polie. Bon comportement. Néanmoins reste peu participative. Un manque de motivation généralisée important. N\'aime pas le ski. Très dure à motiver pour les autres activités. A l\'aise dans un groupe peu de chamaillerie avec les autres jeunes. Susceptible.'),
	(199,4,4,'2015-03-03 17:58:04','2015-03-05 18:47:07',666,76,'1er partie séjour : Comportement en dent de scie. Taquine un peu trop les autres. Trop indépendant. Si intéressé tout va bien, sinon devient perturbateur. 2ème partie : Réaction parfois enfantine à la frustration. N\'écoute pas ( se renferme lors d\'échange. A dérobé des canettes à un camarade de chambre. Nie avoir pris les 40€ associé. Retrouvé par la suite sous son sac. A frapper 2 fois une jeune fille de 14 ans ( une claque dans l\'oreille et étreinte au cou avec son bras). A éprouvé et mis en difficulté l\'équipe d\'accueil et moi même par son comportement d\'autonome, d\'ignorance de l\'adulte (ne répond pas), récidive malgré les consignes.  A spontanément rendu la 2ème semaine le duvet soit disant offert par un jeune de de 8 ans lors de le 1er semaine. Le comportement d\'agitation de ce séjour est néanmoins plus atténué que lors de cet été. Il reste encore bien trop élevé. NPR'),
	(200,4,4,'2015-03-04 19:10:07','2015-03-04 19:11:28',764,76,'Dans l\'observation. Bon début de séjour. A frappé un autre jeune au visage lors d\'un différent en fin de séjour. Repris sur le fait mais pas réabordé par la suite. Revoir ce point avec le jeune.'),
	(201,4,4,'2015-03-04 19:14:02','2015-03-04 19:14:02',699,76,'Agréable, poli, discret  RAS +'),
	(202,4,4,'2015-03-04 19:28:32','2015-03-04 19:28:32',754,76,'Bon séjour. Attitude un peu insolente  le 1er jour (test de jeune?) puis c\'est montré agréable. Participatif. A l\'aise dans un groupe. Peu se laissé influencer. Bonne attitude générale lors du séjour. Aurait offert à un autre jeune plus grand son duvet. Duvet récupérer avec l\'aval du jeune pour restitution.'),
	(203,4,4,'2015-03-04 19:31:47','2015-03-04 19:31:47',753,76,'Bon séjour.  Agréable. Participatif. A l\'aise dans un groupe. A horreur de perdre, très mauvais joueur.'),
	(204,4,4,'2015-03-04 19:48:05','2015-03-06 17:03:56',700,76,'Ne comprend pas les consignes, est dans son monde.  Aime faire le pitre et faire rire les autres.  A du être recadré régulièrement. Complètement concentré, A bien progressé grâce à sa concentration, motivation et ténacité au ski. Pipi au lit quotidien. Peut être préférable de le garder au gite.'),
	(205,4,4,'2015-03-04 20:28:12','2015-03-04 20:34:15',680,76,'1er semaine : Très enfantin. Insolent. Bagarreur, peu frapper. Raille méchamment les autres jeunes. A été plusieurs fois repris pour cela. 2ème semaine : Net amélioration et effort fourni mesurable. Était en attente de remarque positive. Aime à être valorisé et fait des efforts en ce sens. Problème d\'encroprosie sur le séjour avec railleries de certains jeunes. Élude complètement.'),
	(206,4,4,'2015-03-04 20:51:39','2015-03-04 21:17:03',679,76,'1ere semaine. Très bonne. Découvre le ski avec beaucoup d\'enthousiasme, de persévérance et progression rapide. Participatif, agréable. Repris ( comme alerté par son éduc ) lors d\'altercation avec son frère Reyen. 2ème semaine : Quelque gros mots repris mais pas plus que beaucoup d\'autres jeunes.  A tempéré ses rapport physique avec son frère. Respecte les règles. Bon physique ou  dynamisme lors des activités qu\'il aime ( ski quotidien la 1er semaine ). Complainte continuelle et manque de stimulation lors d\'une petite ballade en raquettes d\'une journée ( peut être du à la fatigue de la 1er semaine ?). Un petit coté effronté parfois.  RAS +'),
	(207,4,4,'2015-03-05 10:19:41','2015-03-05 10:26:07',669,76,'Retrouvé par 2 fois sous le lit des filles. Ce serre dans la réserve ( emballage chocolat trouvé sous son oreiller, utilise le déodorant d\'un animateur). Semble être manipulateur. Beaucoup de réparti. Volonté de vouloir appartenir au monde des grands.  Peu lasser car s\'immiscie de façon gauche et inapproprié dans les conversations. Apprécie d\'être valorisé. Indépendant. Peu finir par être ponctuellement rejeté par les autres jeunes. Jeunes poli, courtois. Conflit et bagarre avec  Chiheb Amroussi.  Marqué au coup voir photo. (Au vue du profile de ce dernier, Samir n\'est pas le déclencheur de cette friction).'),
	(208,4,4,'2015-03-05 11:09:38','2015-03-05 11:14:33',46,76,'Tendance à une expression explosive dès lors qu\'elle est en dispute avec d\'autres jeunes. (colère démesurée et grossièreté, peu quitter un groupe). Très susceptible. L\' accompagner  pour une meilleur expression de ses désaccords. Jeune poli et agréable RAS+'),
	(209,4,1,'2015-03-05 11:19:08','2015-05-06 17:43:57',53,76,'Agression physique quotidienne sur d\'autres jeunes. (motivé par des raisons souvent insignifiante). Repris à chaque fois mais récidive malgré ses promesses. Cette attitude exceptionnelle lors des précédent séjour est devenu coutumière. sur ce séjour.  Prévenance effectuée.\r\nNPRSE'),
	(210,4,4,'2015-03-05 16:45:48','2015-03-05 16:45:48',375,76,'Très bon séjour. Comportement irréprochable.  Santé fragile (toux). Bonne évolution par rapport au séjour précédent.'),
	(211,4,4,'2015-03-05 16:50:17','2015-03-05 16:50:17',376,76,'Très bon séjour. Comportement irréprochable.  Bonne intégration et participatif.'),
	(212,4,4,'2015-03-05 17:08:52','2015-03-05 19:13:41',515,76,'Impulsif. vif, insulte, ne respecte pas les règles ni animateurs.  Soucis face à la frustration. Vigilance.  Ce comportement n\'a pas été permanent dans la durée du séjour. (inscrit des WE + avril à venir. Reprendre cela avec le jeune conjointement avec Mr Sahui).'),
	(213,4,4,'2015-03-05 17:34:31','2015-03-05 17:35:13',519,76,'Dramatise facilement une situation avec des tiers. Raconte à l\'envi son histoire. Recherche une relation exclusive avec l\'adulte.   Agréable, poli et participative. Bon relationnel avec les reste du groupe. Source d\'information sur la vie du groupe.'),
	(214,4,4,'2015-03-05 17:44:01','2015-03-05 17:44:01',44,76,'Adorable, très bon, jovial et participatif. A pleuré durant un transfère du ski au gite du faite de la présence de la mère. Pleure encore à la fin du séjour pour cause de la main plâtrée de la mère.  Attention particulière car très distret.'),
	(215,4,4,'2015-03-05 17:47:07','2015-03-05 17:47:07',518,76,'Jovial, souriante.  (ne ski pas, pas de luge).  A semblé épanoui et détendu tout au long du séjour. RAS +'),
	(216,4,4,'2015-03-05 18:13:10','2015-03-05 18:46:16',724,76,'Recherche constante du conflit avec  l\'adulte. Peu se montrer violente envers les autres jeunes. On ne peut pas lui faire confiance.  A fait parti d\'un groupe de 3 filles particulièrement difficile. Parfois leader parfois suiveuse. A éprouvé durement l\'équipe d\'accueil. NPR'),
	(217,4,4,'2015-03-05 18:24:20','2015-03-05 18:45:01',763,76,'Très agité. Grande difficulté comportementale.  N\'écoute pas les consignes ni règles. Peur du noir, soucis au coucher malgré la lumière du couloir et la présence d\'un animateur. Grande difficulté à la concentration. Dissipé. Rapport fille ambigu. A eu tendance  à toucher les filles  avec insistance (plusieurs cas).  A fini par arrêter grâce à notre insistance et reprise. Insulte les filles au télésiège.  Parole et discours déplacé. Se serai exhibé dans un véhicule. A proposé de dormir avec une animatrice sous prétexte qui à peur la nuit.'),
	(218,4,4,'2015-03-05 19:13:14','2015-03-05 19:18:42',743,76,'Sympathique, plein d\'énergie, jovial, mais aussi déstabilisant par un coté colérique à la frustration ou moquerie des autres jeunes obligeant à faire preuve de fermeté pour qu\'il arrête.  (ex : chanson Mahmadou avait mal aux dents) A travailler. Au final bon profil et apprécie les activités sportives'),
	(219,4,4,'2015-03-05 19:21:49','2015-03-05 19:22:19',526,76,'Comme à son accoutumé plaisante et agréable. A moins cherché à se valorisé par les taches de la vie quotidienne et c\'est tant mieux. Aime les sports d\'hivers.'),
	(220,4,4,'2015-03-05 19:31:11','2015-03-05 19:31:52',725,76,'Ne respecte pas les consignes et règles. Evolu trop souvent en autonomie. Tente de faire des efforts mais rarement suivi de faits. Influençable. Individuellement peut être agréable. A fait parti d\'un groupe de 3 filles qui ont durement éprouvé l\'équipe d\'accueil. Rapport violent avec sa sœur et les autres. NPR'),
	(221,4,4,'2015-03-05 19:33:42','2015-03-06 17:31:55',752,76,'Provocatrice, moquerie méchante. N\'hésite pas à aller dans la confrontation physique. Fauteur de trouble. Fais fi des règles même celles de sécurité ( ski, biathlon..). et des remarques. Nonchalance et attitude effronté.  Discussion impossible. A durement approuvé l\'équipe d\'accueil. NPR'),
	(222,4,4,'2015-03-05 20:33:21','2015-03-05 20:33:21',752,76,'Fauteur de trouble. Trop souvent dans la provocation'),
	(223,4,4,'2015-03-05 20:35:06','2015-03-05 20:35:06',526,76,'Comme à son accoutumé plaisante. A moins cherché à se valorisé par les taches de la vie quotidienne et c\'est tant mieux. Aime les sports d\'hivers.'),
	(224,4,4,'2015-03-06 17:59:22','2015-03-06 17:59:22',735,76,'1er semaine : Repris plusieurs fois, agité, bagarreur, peu se moquer méchamment, effronté devant les remarques. 2ème semaine : net amélioration, effort de Reyen remarqué (était dans l\'attente que l\'on remarque ses efforts). Aime à être valorisé. Problème d \'encroprosie constaté. Moquerie des autres jeunes à ce sujet. Régulière intervention auprès de son grand frère pour qu\'il ne recadre par Reyen.  A pleuré lors du séjour (sa maman lui manquant). Bon séjour.'),
	(225,4,4,'2015-03-06 18:22:44','2015-03-06 18:22:44',728,77,'Comportement imprévisible, violent. A représenté un danger pour lui même et autrui. Voir rapport circonstancié \" jeunes, Chiheb Amroussi. NPR'),
	(226,4,4,'2015-03-07 11:06:39','2015-03-07 11:06:39',729,77,'Bon début de séjour malgré une attitude effronté lors de remarques. A œuvré dans un 1er temps pour tempérer l\'attitude de son frère. Puis a pris son parti. Bousculade à l\'encontre d\'une animatrice lors d\'un conflit entre animateurs et son frère. NPR'),
	(227,4,4,'2015-03-07 11:16:51','2015-03-07 11:42:11',8,77,'Une seul source de conflit verbale puis physique (Yassine Christino) lors de ce séjour ( net amélioration au regard des précédents). Crée des situations peut être pour attirer l\'attention de l\'adulte (objet personnel perdu ou égaré). Bon séjour dans l\'ensemble entaché tout de même au début par l\'envoi d\'un coup de pray (parfum) dans les yeux du petit Fabien partageant sa chambre et en fin de séjour par un coup de poing asséné par surprise dans son l\'estomac. Yassine n\'explique pas ses gestes.   Yassine semble vouloir faire des efforts. Ces Points doivent être repris lors des prochains WE conjointement avec son éducatrice spécialisée. Inscrit aussi en avril 2015.'),
	(228,4,4,'2015-03-07 11:28:19','2015-03-07 11:28:19',550,77,'Très bon séjour, agréable, poli et participatif. Sait exprimer un avis ( + de séance de ski). Demandeur d\'activité. RAS ++'),
	(229,4,4,'2015-03-07 11:38:49','2015-03-07 11:38:49',737,77,'Un tempérament calme et nonchalant. A du mal à respecter les consignes (un coté distrait ?). Ne se rebelle pas mais adopte une attitude frontiste lors d\'échange. Sportif et  assidu lors des séances de ski. Bon séjour malgré un relationnel parfois agaçant avec l\'équipe.'),
	(230,4,4,'2015-03-07 11:43:07','2015-03-07 11:43:07',738,77,'1er et très bon séjour. Agréable et participative. RAS+'),
	(231,4,4,'2015-03-07 11:49:14','2015-03-07 11:49:14',47,77,'Manque de motivation. Peu participative. Susceptible et un peu complexée. N\'aime pas grand chose hormis les ateliers d\'art plastique. A un bon relationnel avec autrui. RAS +'),
	(232,4,4,'2015-03-07 12:00:29','2015-03-07 12:00:29',49,77,'Recherche à s\'affirmer envers l\'adultes et les autres jeunes par la moquerie. Une attitude ferme et rapide de ma part le 1er jour lors du transfère des jeunes  à permis d\'atténuer ce comportement. Une bagarre entre jeunes à cause de moqueries incessantes (moqueries auxquelles Valentin à pris une part active) à je pense permis qu\'il prenne conscience des difficultés que cela pouvait engendrer au sein d\'un groupe. Pour le reste bonne tenu et attitude correct lors du séjour RAS +'),
	(233,4,4,'2015-03-07 12:06:21','2015-03-07 12:06:21',50,77,'Fait preuve de maturité. Attitude irréprochable malgré qu\'il se laisse entraîner parfois par son frère et Ludo dans une attitude de moquerie envers autrui. Agréable et participatif . Très bonne progression au ski. RAS++'),
	(234,4,4,'2015-03-07 12:14:24','2015-03-07 12:14:24',732,77,'Jeune très positif. Très sensible.  Triste parfois (maman décédée récemment). Volontaire.  Séjour entaché par le comportement associable d\'un camarade de chambre (coup et menace de Chiheb). (Alerter et revoir ce point avec lui).'),
	(235,4,4,'2015-03-07 12:20:56','2015-03-07 12:20:56',93,77,'Attitude exemplaire lors de ce séjour. A su se soustraire d\'un groupe  le raillant en venant s\'installer à la table de l\'équipe au repas. A réaffirmé auprès d\'un animateur le souhait de ne plus être inscrit au séjour gite. Après échange Yassine confirme bien que c\'est des WE dont il s\'agit. Conclusion ses venues prochaines \"WE gite\" ont été annulé. et le séjour d\'avril maintenu. RAS + sur ce séjour.'),
	(236,4,4,'2015-03-07 12:31:33','2015-03-07 12:53:49',607,77,'S\'exprime et s\'extériorise par un verbe et phrasé bien trop haut pouvant devenir gênant notamment dans les lieux public.  Ne dis pas toujours la vérité ( déclaration d\'argent de poche). Conflit intérieur entre l\'appartenance au monde des jeunes et celle des animateurs. Bon séjour. A exprimer le souhait d\'effectuer son stage pratique BAFA au gite. Projet réalisable sur un groupe de plus jeunes au gite.'),
	(237,4,4,'2015-03-07 12:38:48','2015-03-07 12:42:01',97,77,'Doit être recadré rapidement aussitôt qu\'il devient insolent, provocateur, moqueur. Ludo est pourtant alerté par les situations qu\'engendre son attitude qui peut l\'amener vers un un conflit physique (Valentin Marcais). Pour le reste jeune agréable et jovial, bon dynamisme . Inconditionnel du ski. RAS+'),
	(238,4,4,'2015-03-07 12:59:07','2015-03-07 16:08:10',478,77,'Bon élément dans un groupe.  Ne change pas suffisamment d\'affaires. Trop discret (se déplace comme une ombre, ne répond pas quand on l\'appelle, joue le temps). Semble avoir apprécié le rythme et ses rapports avec les autres jeunes (à vérifier à cause des absences d\'extériorisation du jeune). Nombreux appels du père pour s\'enquérir des nouvelles de ses enfants. RAS++(Réfléchir à la stimulation que l\'on pourrait apporter)'),
	(239,4,4,'2015-03-07 13:04:28','2015-03-07 13:04:28',479,77,'Le moins introverti des 4 frères. (S\'exprime quand quelque chose le dérange. Demande quand il a besoin de quelque chose) A l\'aise dans un groupe. RAS++'),
	(240,4,4,'2015-03-07 13:13:12','2015-03-07 16:07:50',480,77,'Discret et effacé pendant tout le séjour. S\'est néanmoins exprimé et extériorisé une fois par l\'humour en fin de séjour à la grande surprise de l\'équipe (lors du retour en véhicule).  Bien que sermonné pour son  humour déplacé, la satisfaction de le voir déclencheur de rire, content de sa bêtise et son expression joyeuse ont plutôt été remarqué par l\'équipe. (1ère démonstration d\'une expression) RAS+(Réfléchir à la stimulation que l\'on pourrait apporter)'),
	(241,4,4,'2015-03-07 16:06:24','2015-03-07 16:07:13',481,77,'Observateur, discret renfermé comme ses 2 grands autres frères. (Réfléchir à la stimulation que l\'on pourrait apporter)'),
	(242,4,4,'2015-03-07 16:16:09','2015-03-07 16:16:09',639,77,'Lent, nonchalant, peu d\'énergie. De nature jovial et détendu. A l\'aise dans un groupe, jamais en conflit. N\'est pas capable de ranger sa chambre sans aide.  A demandé l\'autorisation d\'acheter un paquet de cigarette. Ne l\'a plus redemandé après mon refus. Très bon séjour. RAS +'),
	(243,4,4,'2015-03-07 16:31:10','2015-03-07 16:36:38',666,77,'Attitude parfois enfantine devant la frustration. N\'écoute pas ou fait mine d\'être sourd. Grande tendance à une liberté de mobilité.  Incident de vole dans sa chambre : A dérobé 3 canettes de boissons mais nie avoir pris les 40€ et carnet de timbres-poste  associés dans le sac de Christopher (par la suite retrouvé dans la chambre et par le chauffagiste  sous le sac de Joris.  A heurté d\'une claque à l\'oreille et d\'une étreinte au coup Tiffany fille de 15 ans. A éprouvé l\'équipe par le non respect des règles et consignes. Déjà refusé sur un séjour à la Toussaint 2014 suite à son comportement de l\'été 2014. NPR.'),
	(244,4,4,'2015-03-07 16:39:41','2015-03-07 16:39:41',520,77,'Adorable, un plaisir de l\'avoir sur le séjour (avis unanime de l\'équipe).\r\nAdeline à du caractère et ne se laisse point apprendre à redire dans le groupe. RAS++'),
	(245,4,4,'2015-03-07 16:41:44','2015-03-07 16:41:44',719,77,'Dynamique, enjoué. proche de sa grande sœur. Plaisant de l\'avoir sur le séjour. RAS++'),
	(246,4,4,'2015-03-07 16:49:13','2015-03-07 16:49:13',196,77,'Posé, poli, courtois. Kévin n\'a jamais posé de difficulté ni par le passé ni maintenant. Très lucide, lors d\'une conversation, sur le devenir de son grand frère Christophe que je connais bien aussi. RAS ++'),
	(247,4,4,'2015-03-07 16:53:26','2015-03-07 16:55:59',703,77,'Calme, posé, discret. Participatif, sais ranger ses affaires et tenir sa chambre.  (40€ lui on été dérobé puis retrouvé).  Pour l\'équipe jeune exemplaire mais comment à t\'il perçu le séjour ?'),
	(248,4,4,'2015-03-07 17:02:26','2015-03-07 17:02:26',730,77,'Calme, discret, effacé, dans l\'observation. Un jeune adolescent qui comprend et tire partie ou profit de se qu\'on lui propose. A régulièrement besoin de se soustraire du groupe pour ce reposer mais le fait toujours avec une prévenance auprès des animateur. A découvert le ski avec enthousiasme et ténacité et à ainsi pu bien progresse. Semble avoir apprécié son séjour. RAS ++'),
	(249,4,4,'2015-03-07 17:09:33','2015-09-24 10:56:56',698,77,'Intelligent, cultivé, participatif. Son séjour a pu être entaché par un camarade de chambre (Chiheb particulièrement difficile). A de la personnalité et ne se laisse pas apprendre à redire. Loîc doit apprendre à mieux maîtriser la rhétorique, être plus détaché afin d\'apprendre à se soustraire de conflit. RAS +'),
	(250,4,4,'2015-03-07 17:18:36','2015-03-07 17:18:36',751,77,'N\'a participé à aucune animation par opposition d\'être là et non chez elle avec son père, sauf \"la boum\" . On la laissé venir (Le statut un peu particulier a été moyennement apprécié de certaine autres filles. Avenante et souriante lors d\'échange aucune difficulté n\'a été relevé. RAS+'),
	(251,4,4,'2015-03-07 17:29:13','2015-03-07 17:48:11',711,77,'N\'a pas reçu son traitement oublié par le père et non réception par la poste alors qu\'il s\'était engagé à nous l\'envoyer. A su gérer son stress grâce à des moments de repos accordés. Susceptible Valentin à agressé en début de séjour un autre jeune qui l\'avait raillé de façon provocatrice et  insistante. Il s\'est montré intelligent dans l\'analyse de sa pulsion aussitôt regretté et la gestion par la suite de ses humeurs. RAS +'),
	(252,4,4,'2015-03-07 17:54:20','2015-03-07 17:54:20',471,77,'Bon séjour RAS ++'),
	(253,4,4,'2015-03-07 17:55:14','2015-03-07 17:55:14',472,77,'Bon séjour, souriante, plaisante RAS ++'),
	(254,4,4,'2015-03-07 18:00:52','2015-03-07 18:00:52',733,77,'Un peu lunaire, dynamique, actif et jovial. Demandeur d\'affection. (A reçu un coup de spray et un coup de poing à l\'estomac par un camarade de chambre. Peut être à aborder avec lui pour désacraliser si nécessaire). RAS ++'),
	(255,4,4,'2015-03-07 18:07:34','2015-03-07 18:07:34',669,77,'Recherche la présence des adultes. Cherche à se démarquer des jeunes. Agace parfois par son insistance et intervention inapproprié. Cherche à se valoriser. Baratineur.  voir note 1ere semaine. Meilleur comportement sur ce séjour qu\'en été 2014. RAS +'),
	(256,4,4,'2015-03-07 18:08:03','2015-03-07 18:08:03',680,77,'voir note 1ere semaine'),
	(257,4,4,'2015-03-07 18:08:23','2015-03-07 18:08:23',679,77,'Voir note 1ere semaine'),
	(258,1,1,'2015-03-16 15:32:22','2015-03-16 15:32:22',778,66,'sympathique, le groupe ayant été très compliqué, cela n\'a pas facilité de déroulé ce we. peut chercher les autres (bruits répétitifs agaçants, moqueries, ...). A voir sur un groupe plus calme.'),
	(259,1,1,'2015-03-16 15:32:39','2015-03-16 15:32:39',516,66,'ras; très agréable.'),
	(260,1,1,'2015-03-16 15:37:34','2015-03-16 15:37:34',46,66,'agréable et partante. mais se braque et s\'emporte très facilement (m\'a mal parlé et quand je lui a dit de se mettre à l\'écart pour réfléchir et qu\'elle pourrait revenir calmé mais avec des excuses, elle s\'est braquée pendant plus d\'une heure, se cacher dans ses cheveux, refusant de manger pour finalement s\'excuser). ne parle pas tjrs bien et envoie balader les autres jeunes. Son attitude peut engendre des conflits. N\'est pas intégrée à 100% forcément dans le groupe (de son attitude et de sa volonté également)'),
	(261,1,4,'2015-03-16 15:42:08','2015-04-07 12:43:15',720,66,'gros soucis de comportement. Se moque très facilement des autres. Rigole exagérément. peut faire des crises si frustrations et peut également chercher la bagarre.  Il a coursé un autre petit, parce que ce dernier lui avait tiré sur sa capuche. J\'ai retenu alors qu\'il perdait déséquilibre dans sa course et ce au niveau de l\'angle du trottoir. Il s\'est fâché et a voulu qd mm foncé sur l\'autre jeune pour lui donner des coups de pieds. Se débat ou se laisse tomber au sol pour ne plus bouger. A du mal à écouter les consignes posées. Comportement très compliqué à l\'intérieur d\'un groupe.\r\nNPR ?\r\n\r\nRetour éducatrice : comportement déjà identifié comme tel  et ont été obligé de le contenir à 3 adultes... -> décision prise d\'arreter la prise en charge et annulation du we du 03-05/04\r\nEN FAIT LE JEUNE ETAIT PRESENT LE 03-05/04 : reprise avec lui du déroulement du we précédent dès le vendredi; cadrage très strict. le we s\'est relativement bien passé, en tout cas : pas de crise'),
	(262,1,1,'2015-03-16 15:44:32','2015-03-16 15:44:32',519,66,'Aime surenchérir qd d\'autres jeunes sont tristes. Intervient abruptement dans les conversations.  a du mal à ne s\'occupe que de ses affaires.\r\nRépète à l\'envi son histoire à toute nouvelle personne (jeune ou adulte).'),
	(263,1,1,'2015-03-16 15:45:32','2015-03-16 15:45:32',601,66,'Ne s\'est pas très bien comportée avec l\'animatrice (coco - 1ère fois qu\'elle la voyait). Peut répondre. gourmande en énergie.'),
	(264,1,1,'2015-03-16 15:47:42','2015-03-16 15:47:42',286,66,'crie, ne respecte pas les consignes. insulte, se moque, rigole exagérément, électrise l\'ambiance. dans la voiture au retour, n\'a pas arrêté de crier, malgré mes nombreuses demandes d\'arrêter. N\'a pas de limites. peut être agréable en relation duelle avec l\'adulte.\r\ntrop compliqué dans un groupe. NPR.'),
	(265,1,1,'2015-03-16 15:49:21','2015-03-16 15:49:21',709,66,'RAS. A pleuré lors d\'une activité musicale. explication : une musique lui a fait pensé à son frère qd il était encore là. (?)\r\nCherche les autres physiquement pour jouer, mais ca peut agacer.'),
	(266,1,1,'2015-03-16 15:51:55','2015-03-16 15:51:55',515,66,'s\'emporte et ne se contrôle pas qd il doit faire face à la frustration (ne voulait pas faire son lit, a renversé une étagère de livres, mais a su se calmer seul en s\'écartant, tout en réussissant ainsi à ne pas faire ce qu\'on lui demandait). A du mal à être réactif qd on lui dde qq chose (fait comme si il n\'entendait pas).\r\na surveillé et peut être envisagé un retour si trop compliqué sur le prochain séjour d\'avril 2015.'),
	(267,1,1,'2015-03-16 15:52:13','2015-03-16 15:52:13',384,66,'pas venu. pb de financement'),
	(268,1,1,'2015-03-16 15:52:24','2015-03-16 15:52:24',699,66,'ras ++'),
	(269,1,1,'2015-03-16 15:53:15','2015-03-16 15:53:15',700,66,'peut se fâcher qd il n\'obtient pas ce qu\'il veut. Groupe du we très compliqué, à voir sur un groupe + calme.'),
	(270,1,1,'2015-03-16 15:57:29','2015-03-16 15:57:29',134,66,'équilibre très fragile. Vendredi, j\'ai discuté avec lui pour rappeler de nouveau le cadre, et ce qu\'on attendait de lui : engagement de sa part. Il a tenu malgré qq tensions (il ne voulait pas partir avec le groupe, mais détacher un adulte pour lui était impossible à organiser. j\'ai du lui mettre un choix qu\'il devait faire : participer ou non - s\'il refusait, il mettait en question ses prochaines venues au gite. Il est venu et m\'a dit après qu\'il avait eu raison de participer, car c\'était vraiment très bien comme balade). dans l\'ensemble, ca a été.'),
	(271,1,1,'2015-03-25 14:24:46','2015-03-25 14:24:46',655,42,'jeune gentil, présente un retard. Ne comprend pas très bien les consignes. S\'amuse bcp seul (avec des voitures, etc). Peut ne pas avoir conscience du danger. Avoir une vigilence constante. Adorable la piscine.'),
	(272,1,1,'2015-04-19 10:50:05','2015-04-26 15:55:52',518,83,'olivia est angoissée au début du séjour (mal de ventre) : elle nous a informée qu\'elle avait été agressée deux jours avant le séjour par un homme qui l\'a menacée avec un couteau pour lui  dérober 200 € (elle a deux bleus sur le bras). Elle a peur qu\'il revienne et recommence.\r\nElle s\'est aussi inquiétée pour sa gd mère qui était à l\'hopital. qq jrs après elle s\'était inquiète que son père soit incarcérée.'),
	(273,1,1,'2015-04-24 22:19:57','2015-05-06 14:48:16',679,83,'1ere sem : ras ++. plus braqué sur la nourriture la 2ème semaine (mais les ctains anim\' ont encouragé cette position). A du mal à se mobiliser sur les temps de la vie quot\''),
	(274,1,1,'2015-04-24 22:20:26','2015-04-24 22:20:32',787,83,'très agréable. Participatif aux acti + temps vie quot'),
	(275,1,1,'2015-04-24 22:20:43','2015-05-06 14:47:58',680,83,'abs : 1ere sem\r\n2ème sem : ras ++. jovial - participant aux activités'),
	(276,1,1,'2015-04-24 22:21:29','2015-05-06 14:49:12',669,83,'tjrs dans un role de séduction. Peut avoir du mal à laisser le dernier mot aux adultes, mais sinon agréable, participe aux acti + vie quot. A un comportement qq fois déplacé vis à vis des filles (très lourd, blagues limites, ...) ras +. A été malade le dimanche soir (26/4 : hopital -> grippe), donc a du rester au chaud.'),
	(277,1,1,'2015-04-24 22:22:14','2015-05-21 10:39:34',519,83,'ras +; peut avoir un comportement qqfs étrange (à parler aux fourmis, etc)\r\ntrès attirée par les grands garcons - invasive - rentre dans l espace vital'),
	(278,1,1,'2015-04-24 22:22:44','2015-04-26 16:07:39',93,83,'ras +. semble un peu inquiet d\'aller en foyer.\r\na essayé de dérober le pantalon de kleyton juste avant le départ en le mettant dans le sac de Mohamed. Mais Kleyton s\'en est rendu compte juste avant le départ. (Yassine l\'avait mis précédemment dans la soirée, en disant qu\'il s\'était trompé, qu\'ils avaient le meme)'),
	(279,1,1,'2015-04-24 22:23:36','2015-04-24 22:23:36',683,83,'ras + jovial, participe à tt. Pb d\'énurésie quasi quotidien (mais le cache et dis que c\'est ok qd ca ne l\'est pas)'),
	(280,1,1,'2015-04-24 22:24:56','2015-04-24 22:24:56',780,83,'actif. jovial, sympa. a du mal à se concentrer'),
	(281,1,1,'2015-04-24 22:25:33','2015-04-24 22:25:33',170,83,'ok. un peu renfermée et taciturne. mais agréable'),
	(282,1,1,'2015-04-24 22:26:14','2015-04-24 22:26:14',786,83,'ras +, agréable - très poli,  participe à ts les temps.'),
	(283,1,1,'2015-04-24 22:26:53','2015-04-24 22:26:53',374,83,'un conflit avec une anim mais est allé s\'excuser ensuite. ras +'),
	(284,1,1,'2015-04-24 22:27:22','2015-04-24 22:27:22',375,83,'ras +. aucun souci - participe à tous les temps'),
	(285,1,1,'2015-04-24 22:28:45','2015-05-06 16:10:26',794,83,'ras + participatif à ts les temps; peut se mettre dans une position de plainte, rale et boude (qd il veut mettre fin à une activite, peut repéter 12 fois en 2 minutes qu\'il veut rentrer). Sur la 2ème sem, un peu plus en retrait - discret  (peut être présence de grds ado...)'),
	(286,1,1,'2015-04-24 22:30:29','2015-04-24 22:30:50',526,83,'ras ++/ a participé à tous les temps. très généreuse avec les autres (pense aux autres avant elle même). évolution + dans sa relation avec ses pairs - elle recherche bcp moins la relation exclusive avec l\'adulte pour être avec les autres'),
	(287,1,1,'2015-04-24 22:31:17','2015-04-24 22:31:47',766,83,'ras ++; très agréable, curieux. très participatif à tous les temps. respectueux des consignes. appel quotidien avec la maman'),
	(288,1,1,'2015-04-24 22:32:55','2015-04-24 22:33:16',797,83,'jeune discrète. a participé à ts les temps. A dit qu\'elle avait été victime d\'attouchements. a du mal à évoquer un souvenir / anecdote positive (jeu info / intox). S\'est détendue tout au long du séjour'),
	(289,1,1,'2015-04-24 22:38:47','2015-04-24 22:38:47',478,83,'discret. Mais a su se porter volontaire pour un jeu de chant devant les autres (avec 7 autres jeunes). Sourit de + en +. Carence de vetements (2 calecons - 2 chaussettes - vett très usés) - mange bcp (reprend systématiquement 2 fois de viande / légumes)'),
	(290,1,1,'2015-04-24 22:39:29','2015-04-24 22:39:29',479,83,'mignon -  ras ++ Carence de vetements (2 calecons - 2 chaussettes - vett très usés) - mange bcp (reprend systématiquement 2 fois de viande / légumes)'),
	(291,1,1,'2015-04-24 22:40:21','2015-04-24 22:40:21',480,83,'ras ++ participe aux activités - Carence de vetements (2 calecons - 2 chaussettes - vett très usés) - mange bcp (reprend systématiquement 2 fois de viande / légumes)'),
	(292,1,1,'2015-04-24 22:40:46','2015-04-24 22:40:46',481,83,'ras ++ - Carence de vetements (2 calecons - 2 chaussettes - vett très usés) - mange bcp (reprend systématiquement 2 fois de viande / légumes)'),
	(293,1,1,'2015-04-24 22:42:03','2015-04-24 22:42:03',367,83,'ras + -  peut se mettre en colère. a eu  du mal à participer mais finalement a été très content d\'avoir fait les acti'),
	(294,1,1,'2015-04-24 22:43:08','2015-04-24 22:43:08',699,83,'ras + tjrs très discret'),
	(295,1,1,'2015-04-26 15:47:02','2015-04-26 15:47:02',44,83,'ras ++'),
	(296,1,1,'2015-04-26 15:47:40','2015-04-26 15:47:40',631,83,'ras ++. joviale. bien intégrée meme auprès des grands'),
	(297,1,1,'2015-04-26 15:51:25','2015-04-26 15:51:25',46,83,'dans l\'ensemble ok, mais se braque facilement pour des raisons futiles (peut refuser de venir manger pendant deux heures) et se cache derrière ses cheveux.\r\nPas de bonnes relations avec les garçons, elle leur repond très agressivement. A une attitude un peu \"hautaine\".'),
	(298,1,1,'2015-04-26 15:51:40','2015-04-26 15:51:40',376,83,'ras +'),
	(299,1,1,'2015-04-26 15:52:41','2015-04-26 15:52:41',544,83,'ras +; participe à ts les temps. particulièrement la vie quot\', veut tjrs aidé'),
	(300,1,1,'2015-04-26 15:53:15','2015-04-26 15:53:15',542,83,'ras ++. plus près des autres jeunes que Ali.'),
	(301,1,1,'2015-04-26 15:56:09','2015-04-26 15:56:09',258,83,'ras ++'),
	(302,1,1,'2015-04-26 15:56:22','2015-04-26 15:56:22',362,83,'ras ++'),
	(303,1,1,'2015-04-26 15:58:49','2015-04-26 15:58:49',515,83,'ok. Le groupe calme  a certainement eu un effet apaisant pour addam. Comportt correct'),
	(304,1,1,'2015-05-06 14:49:55','2015-05-06 14:49:55',471,83,'plus posée et relations avec sa soeur plus apaisées. Très agréable sur ce séjour. Etait triste de repartir'),
	(305,1,1,'2015-05-06 14:50:13','2015-05-06 14:50:13',472,83,'ras ++. Bonne relation avec sa soeur'),
	(306,1,1,'2015-05-06 14:52:08','2015-05-06 14:52:27',782,83,'parle très facilement (et à tous) du décès de ma maman. S\'est coincé les doigts dans la portière -> hopital : ras / grosse contusion.\r\nSe demandait comment son gd frère allait réagir, si il allait s\'en faire.\r\nJeune agréable. Participe à tous les temps'),
	(307,1,1,'2015-05-06 14:52:53','2015-05-06 14:52:53',791,83,'ras ++; jeune agréable - pas de souci avec son frère'),
	(308,1,1,'2015-05-06 14:54:28','2015-05-06 14:54:28',558,83,'ras + - s\'est très bien entendu avec une anim\' auprès de qui il était tout le temps. Cela a permis de faciliter le séjour. Aime être avec les plus grands.'),
	(309,1,1,'2015-05-06 14:55:43','2015-05-06 14:55:43',350,83,'ras +. Malade le mercredi 28/4 -> médecin : angine / antibio. Jeune très discret, qui ne communique pas avec les adultes sur ce qu\'il ressent, pense. Est très bien avec ses pairs.'),
	(310,1,1,'2015-05-06 14:56:41','2015-05-06 14:56:41',97,83,'ras+.  L\'abs des jumeaux a calmé le comportement. Moins dans la moquerie / chahut'),
	(311,1,1,'2015-05-06 15:17:44','2015-05-06 15:17:44',784,83,'jeune très discret - gentil mais ne parle quasiment pas. On n\'arrive pas à savoir ce qu\'il pense. Malade le mardi soir, médecin - > mercredi 28/4 : angine -> antibio. S\'amuse bien avec les autres'),
	(312,1,1,'2015-05-06 15:18:28','2015-05-06 15:18:28',785,83,'ras +.  Jeune sympa'),
	(313,1,1,'2015-05-06 15:24:27','2015-05-06 15:24:27',557,83,'ras +. Difficulté pour la nourriture, ne mange quasiment rien. Ne parle pas bcp aux adultes'),
	(314,1,1,'2015-05-06 15:26:50','2015-05-06 15:26:50',145,83,'ras +. jeune très agréable et participante à tous les temps. Sportive. Le dernier soir, un anim\' est intervenu alors que les filles allaient dans la chbre des gars.\r\nAu départ et avant le retour, angélique se porte les cheveux avec la capuche de son manteau.\r\nau retour, elle était contrariée car son père a du partir sans la prévenir en Egypte.'),
	(315,1,1,'2015-05-06 15:32:50','2015-05-06 15:32:50',798,83,'jeune qui peut se montrer agréable et proposer son aide pour les tâches de la vie quot\'. A surveiller dans la relation aux garçons. Un  anim\' a du intervenir la dernière nuit car les filles ont été dans la chbre des gars de 15-17 ans. Elodie a essayé de se cacher dans la chbre pour qu\'on ne la voit pas.\r\nJeune qui peut être tristoune, qui peut également se fâcher / braquer, mais ca ne dure pas longtemps. En capacité d\'entendre.'),
	(316,1,1,'2015-05-06 15:33:20','2015-05-06 15:33:20',745,83,'ras ++. Jeune très sympa et participante pour tous les temps. Très agréable'),
	(317,1,1,'2015-05-06 15:33:46','2015-05-06 15:34:00',800,83,'ras ++. Jeune très agréable, jovial et participant à tous les temps de la vie quot\'.'),
	(318,1,1,'2015-05-06 15:37:04','2015-05-06 15:37:04',760,83,'Enurétique, mais cache en allant jsq à mentir. Ne gère pas du tout ses vêtements. A rencontré des pb avec les autres jeunes : s\'est bagarré deux-trois fois. Les autres se moquaient de lui (parlaient de lui au féminin : dreads ?). Mais c\'est un jeune gentil et agréable dans sa relation aux adultes.'),
	(319,1,1,'2015-05-06 15:38:17','2015-05-06 15:38:17',801,83,'jeune gentil, agréable. Se déclare surdoué avec un qi de 140. Assez présomptueux. Participe à  tous les temps de la vie quot\' + activités'),
	(320,1,1,'2015-05-06 15:38:29','2015-05-06 15:38:29',804,83,'pas venu'),
	(321,1,1,'2015-05-06 15:40:28','2015-05-06 15:40:28',664,83,'jeune agréable. bien intégré. pas de souci de comportement. Malade le mercredi 29/4 : médecin -> sinusite / antibio. pas d\'attestation cpam (rembours. ok des parents). Mme a appelé sans cesse pour avoir des nouvelles de son fils.'),
	(322,1,1,'2015-05-06 15:40:51','2015-05-06 15:40:51',384,83,'ras +. aucun souci - participe à tous les temps.'),
	(323,1,1,'2015-05-06 15:42:29','2015-05-06 15:42:29',805,83,'jeune pouvant poser des petits soucis de comportement (cadre à poser) : qq bagarre avec les autres, attitude moqueuse (appelait un autre garcon au féminin - dickenson). à surveiller'),
	(324,1,1,'2015-05-06 15:43:15','2015-05-06 15:43:15',808,83,'ras + jeune discret, agréable, bien intégré avec les autres. participe'),
