	(329,1,1,'2015-05-06 16:05:42','2015-05-06 16:05:42',536,80,'adorable. ras ++. très émotive. dynamique'),
	(330,1,1,'2015-05-06 16:07:52','2015-05-06 17:08:52',700,80,'1ere semaine : énergique, dissipé, très communiquant. veut attirer l\'attention. difficulté à la frustation. très théâtral. c\'est bien mis en valeur lors d\'une chorégraphie. demande une attention particulière. sinon séjour +\r\n2ème semaine : N\'écoute pas ou peu. peut être brusque. ne gère pas son énurésie. A eu un pb de caca dans son slip. Il prend seul et à son initiative une douche tous les matins en autonomie, mais il cache ses affaires sales dans son sac et ne nettoie pas.'),
	(331,1,1,'2015-05-06 16:08:45','2015-05-06 16:08:45',655,80,'C\'est un zébulon, dit des gros mots et peut braver l\'autorité. distrait. Ras +'),
	(332,1,1,'2015-05-06 16:18:44','2015-05-06 16:18:44',792,80,'ras +, plus détendue sur la 2ème semaine'),
	(333,1,1,'2015-05-06 16:19:57','2015-05-06 16:19:57',793,80,'un peu nonchalante. on doit s\'y reprendre à plusieurs fois pour qu\'elle s\'exécute. Moins d\'entrain et moins participative sur la 2ème semaine'),
	(334,1,1,'2015-05-06 16:20:22','2015-05-06 16:51:22',790,80,'dans son monde. n\'écoute. distrait. repris plusieurs fois.\r\nmanque d\'autonomie, difficulté à écouter et comprendre les consignes. très sensible.\r\nras+'),
	(335,1,1,'2015-05-06 16:25:05','2015-05-06 16:25:05',417,80,'il faudrait envisagé des séjours séparés d avec sa soeur. ras +'),
	(336,1,1,'2015-05-06 16:25:57','2015-05-06 16:25:57',418,80,'brave souvent l\'interdit. Conflit avec sa soeur. Crise d\'angoisse suite à un conflit avec sa soeur. Parle en négatif de sa mère.'),
