	(338,1,1,'2015-05-06 16:35:41','2015-05-06 16:35:41',708,80,'bon séjour - bonne amélioration par rapport au précédent séjour. Volontaire, aide les autres, serviable. Ras ++ - Essaie de jouer au role d\'adulte. Vomi systématiquement après chaque repas.'),
	(339,1,1,'2015-05-06 16:36:23','2015-05-06 16:41:40',777,80,'bébé. pas autonome. rythme décalé par rapport  à ce qu\'on pourrait attendre d\'une enfant de 6-7 ans. dispute fréquente avec mélani'),
	(340,1,1,'2015-05-06 16:42:27','2015-05-06 16:42:27',718,80,'ras +. dispute fréquente avec Noelle. Se renferme qd on la reprend'),
	(341,1,1,'2015-05-06 16:44:22','2015-05-06 16:46:14',637,80,'demande d\'affection forte. impossible d\'envisager une sortie extérieure, trop indiscipliné. ne respecte pas les consignes. M\'a appelé papa et une anim\' maman. A besoin de s\'isoler continuellement ou en groupe rapports conflictuels. A frappé ou a porté des coups sur une majorité des autres jeunes. fais des crises.\r\nNPR'),
	(342,1,1,'2015-05-06 16:45:19','2015-05-06 16:45:19',749,80,'Rentre dans la préadolescence. imbu de sa personne. toise de haut l\'adulte. provocation et esprit de contraction. n\'a pas de pb particulier. pas d\'esprit collectif.'),
	(343,1,1,'2015-05-06 16:45:45','2015-05-06 16:47:56',796,80,'en retrait en début de séjour. A pleuré le 1er jour. a conversé avec son père, qui a permis de désacralisé  la séparation. a fini rapidement par s\'adapter et à s\'amuser. très calme et très posée, aime la lecture et les temps calmes. Mais sais être dynamique lors des activités sportives. \r\nRas +++'),
	(344,1,1,'2015-05-06 16:48:30','2015-05-06 16:48:30',795,80,'très souriant, aime s\'amuser, détendu dès le 1er jour. curieux, et participatif\r\nras +++'),
	(345,1,1,'2015-05-06 16:49:04','2015-05-06 16:49:04',783,80,'dynamique, handicapé par son arrivée tardive. a besoin de s\'isoler. très autonome. très sportif et habile.\r\nras +++'),
	(346,1,1,'2015-05-06 16:50:34','2015-05-06 16:50:34',803,80,'très active, très sportive, souriante. distrainte\r\nras +'),
