	(360,1,1,'2015-07-28 16:31:50','2015-07-28 16:31:50',921,86,'toc et manique (vider son sac et le remettre plus fois / pliage du linge sans arrêt). très ordonné. Distrait, à du mal à suivre les consignes - très bavard - ras +'),
