	(379,1,1,'2015-07-28 17:14:25','2015-07-28 17:14:25',815,86,'pb relationnel aux autres - n\'écoute pas - peut faire des longues crises  - A frappé une anim\' sans avoir conscience de la gifle. Après passage de l\'éduc, ce qui est ressorti : crainte que sa maman meure, l\'oublie, ne vienne pas la chercher. \r\nA du mal à tenir ses engagements. Cherche les autres (bouscule et fait comme si ce n\'était pas fait express).\r\nAmélioration dans la semaine (à partir de lundi), fait des efforts.'),
