	(416,1,1,'2015-08-20 12:53:19','2015-08-20 13:13:39',485,87,'Fumeuse - accro à son téléphone. \r\ns\'est bien tenue jsq milieu de la 1ère semaine. A eu son éducatrice, qui lui avait laissé entendre qu\'elle pourrait rentrer dès le 15. Or durant la conversation, Fineza a fait part de son souhait de rentrer. Refus et négociation pour qu\'elle reste jsq mardi  officiellement (officieusement l\'éduc n\'avait pas l\'intention de donner suite à cette demande). Fineza a mis en oeuvre un comportement pour mettre fin au séjour (debout jsq à 1h du mat faisant du bruit, parlant fort, refus de se coucher, disant qu\'on lui parlait comme un chien...). Retour effectif le 15.\r\nElle a mis en difficulté l\'équipe. Elle veut faire ce qu\'elle veut, qd elle veut'),
	(417,1,1,'2015-08-20 12:54:04','2015-08-20 12:54:04',824,87,'RAS +. Jovial. Participant à tous les temps'),
	(418,1,1,'2015-08-20 12:54:46','2015-08-20 12:54:46',827,87,'RAS +. Est un peu dans sa bulle. Pb d\'hygiène (douche douteuse)'),
	(419,1,1,'2015-08-20 12:55:56','2015-08-20 12:55:56',828,87,'RAS +. Jeune réservée, agréable. la maturité ne correspond pas à son age civil (14/15). Influencable'),
	(420,1,1,'2015-08-20 12:55:57','2015-08-20 12:55:57',828,87,'RAS +. Jeune réservée, agréable. la maturité ne correspond pas à son age civil (14/15). Influencable'),
	(421,1,1,'2015-08-20 12:57:03','2015-08-20 12:57:03',830,87,'Ras ++. Jeune sympathique. Durant la dernière sem, moins jovial. participant. Volonté de bien faire'),
	(422,1,1,'2015-08-20 12:57:33','2015-08-20 12:57:33',841,87,'ras +. agréable. Aucun pb de comportement'),
	(423,1,1,'2015-08-20 12:58:04','2015-08-20 12:58:04',842,87,'ras +. Jeune réservé. Physiquement ne fait pas son age'),
	(424,1,1,'2015-08-20 12:59:32','2015-08-20 12:59:32',558,87,'ras +. Pas souci. Avoir une vigilence, peut déborder. A très accrochée à la formation Etoiles.\r\nRecherche une relation privilégiée, aime être avec les + gds'),
	(425,1,1,'2015-08-20 13:00:35','2015-08-20 13:00:35',780,87,'Après une 1ere sem compliquée (du mal à respecter les consignes et le cadre), 2ème sem : pas de souci. Jeune qui demande une vigilence. A besoin du cadre'),
	(426,1,1,'2015-08-20 13:01:03','2015-08-20 13:01:03',853,87,'Ras +. jeune agréable et participative'),
