	(428,1,1,'2015-08-20 13:01:52','2015-08-20 13:01:52',44,87,'Enurique qui cache. Mettre impérativement une grosse alèse plastique. Sinon Ok'),
	(429,1,1,'2015-08-20 13:02:52','2015-08-20 13:02:52',869,87,'Ras +++. Jeune discret, très poli et respectueux des consignes.'),
	(430,1,1,'2015-08-20 13:03:05','2015-08-20 13:03:05',264,87,'Ras.'),
	(431,1,1,'2015-08-20 13:04:05','2015-08-20 13:04:05',96,87,'ras +. Vigilance sur sa relation avec les autres. Peut chercher les autres'),
	(432,1,1,'2015-08-20 13:04:50','2015-08-20 13:04:50',880,87,'ras +. Est dans sa bulle.'),
	(433,1,1,'2015-08-20 13:05:23','2015-08-20 13:05:23',891,87,'ras +. Jeune un peu bruyant. mais participant à tous les temps.'),
	(434,1,1,'2015-08-20 13:06:03','2015-08-20 13:06:03',290,87,'jeune compliqué. Peut voler. Cherche et se bagarre facilement.'),
	(435,1,4,'2015-08-20 13:07:45','2015-09-24 10:58:01',957,87,'jeune compliqué. Se bagarre très facilement, ne reconnait pas ses actions, se positionne en victimes (ce sont tjrs les autres qui le traitent, qui ont traité sa mère). Répond aux adultes. NPR ?'),
	(436,1,1,'2015-08-20 13:09:01','2015-08-20 13:09:35',946,87,'Fumeur - est arrivé avec 200€.\r\nras. Jeune discret et réservé avec l\'adulte. On sent que si on va à la confrontation avec lui, on aura au mieux un mur mais il peut montrer en pression et ne sera pas impressionné par l\'adulte.'),
	(437,1,1,'2015-08-20 13:09:58','2015-08-20 13:09:58',730,87,'Ras ++++. Coup de coeur.'),
	(438,1,1,'2015-08-20 13:10:45','2015-08-20 13:10:45',929,87,'Jeune qui électrise une salle. Bouge bcp, très bruyant mais jeune sympa. Participant à tous les temps'),
	(439,1,1,'2015-08-20 13:11:57','2015-08-20 13:11:57',906,87,'Ras Jeune sympa'),
	(440,1,1,'2015-08-20 13:12:15','2015-08-20 13:12:15',905,87,'ras. Jeune sympa, discret'),
	(441,1,1,'2015-08-20 13:12:39','2015-08-20 13:13:05',97,87,'amélioration par rapport au séjour de bacilly. S\'est dit lui mm plus apaisé'),
	(442,1,1,'2015-08-20 13:14:13','2015-08-20 13:14:33',208,87,'ras +. Jeune distrait qui a besoin qu\'on l\'accompagne dans les temps de la vie quot'),
	(443,1,1,'2015-08-20 13:15:05','2015-08-20 13:15:05',899,87,'ras +++\r\nFaire attention, bcp d\'allergies alimentaires'),
	(444,1,1,'2015-08-20 13:16:27','2015-08-20 13:16:27',900,87,'jeune très compliqué. Troubles du comportements qui mettent régulièrement l\'équipe en difficulté. Est dans son monde, peut se bagarrer, s\'en va. A cassé la porte vitrée en lançant des gravillons sur un autre jeune.\r\nNPR'),
	(445,1,1,'2015-08-20 13:16:45','2015-08-20 13:16:45',557,87,'n\'est pas venu'),
	(446,1,1,'2015-08-20 13:19:32','2015-08-20 13:19:32',145,87,'Ras +. A du un coup de blues jeudi 13/08. S\'est mise à pleurer très violemment et s\'est confiée à moi. A du mal à faire confiance aux autres et à elle mm. M\'a ddé d\'être l\'intermédiaire auprès de ses éduc. \"a besoin d\'un psy mais ne veut pas que sa mère sache qu\'elle ddemandeuse. Elle souffre bcp).'),
	(447,4,4,'2015-08-30 17:53:43','2015-08-30 17:55:48',643,84,'Voir yaz / pb tel / violence physique envers yaz (l\'a poussé pls fois pour avoir son tel) / volonté de partir / retour anticipé -> annulation par nous de la 2ème sem / \r\nNPR'),
	(448,1,1,'2015-09-02 10:55:08','2015-09-02 11:29:24',384,84,'Quelques difficultés avec le respect du  cadre mais jamais conflictuel. Enfant jovial et participatif. RAS positif'),
	(449,1,1,'2015-09-02 10:55:40','2015-09-02 10:55:40',484,84,'Absente du séjour'),
	(450,1,1,'2015-09-02 11:12:21','2015-09-02 11:12:21',825,84,'Jeune joviale et participatif.  Peu influençable par les autres jeunes. Sais éviter les petites bêtises et utilise à bonne escient son libre arbitre. RAS positif +'),
	(451,1,1,'2015-09-02 11:28:50','2015-09-02 11:28:50',826,84,'Bonne entente avec le reste des jeunes.  Nerveux et excité.  énergie débordante. RAS positif +'),
	(452,1,1,'2015-09-02 11:35:15','2015-09-04 16:21:10',827,84,'Enfant très calme et participatif. Rester vigilant car éprouve un besoin de s\'isoler. Apprécie les activités calmes. Très discrète. Attention de ne pas l\'oublier. RAS positif +'),
	(453,1,1,'2015-09-02 11:46:16','2015-09-04 16:19:46',828,84,'Dans l\'observation en début de séjour. Discrète, peu expressif et peu communicante.  Coralie s\'est montré de plus en plus souriante, détendue et participative au fur et à mesure du séjour. Il faut avec finesse inciter Coralie à prendre une plus grande place au sein du groupe. La faire participer à des ateliers de théâtre ou d\'expression. Par ailleurs, La sentant vulnérable une animatrice est intervenue à ma demande pour alerter Coralie sur la proximité qu\'elle entretenait avec les adolescents. RAS très positif +'),
	(454,1,1,'2015-09-02 11:54:15','2015-09-02 11:54:15',830,84,'Sympathique et jovial.  Une petite tendance à la moquerie envers d\'autres jeunes qui l\'a mis en difficulté. Peut être un besoin de s\'affirmer.  Difficulté à l\'endormissement le soir. RAS positif+.'),
	(455,1,1,'2015-09-02 12:05:36','2015-09-02 12:19:25',478,84,'Comme à l’accoutumé enfant extrêmement  discret voir mystérieux. Semble parfois très mal à l\'aise quand on l\'interpelle. Echange difficile et rarement à son initiative. J\'ai conversé avec son jeune frère Sountougoumba pour savoir si il rencontrait des difficultés  sans succès. Aucune difficultés dans le groupe et sait se faire apprécié. Manque cruellement de vêture. RAS positif +'),
	(456,1,1,'2015-09-02 12:09:13','2015-09-02 12:18:22',479,84,'A l\'aise dans un groupe.  Le  plus communicatif de la fratrie envers les autres jeunes. Manque cruellement de vêture. RAS positif +'),
	(457,1,1,'2015-09-02 12:18:03','2015-09-02 12:20:06',480,84,'Point commun à la fratrie discret et réservé. Les 4 frères sont souvent attablés ensemble. Communication plus facile avec Sountou. RASpositif +'),
	(458,1,1,'2015-09-02 12:26:57','2015-09-02 12:26:57',481,84,'Le plus souriant. Ce qui n\'empêche pas de devoir aller vers lui si l\'on veut échanger. Manque cruellement de vêture. RAS positif +'),
	(459,1,1,'2015-09-02 12:39:25','2015-09-02 18:10:37',841,84,'Début de séjour difficile voir conflictuel. Non respect du cadre et surenchère verbale systématique dès lors qu\'on la reprend. N\'a pas été suivi par les autres filles de son age. Un point  a dû être fait à 2 reprises. Puis nette amélioration peut être dû à une fin de séjour envisagé. Somaya sait entendre et a pris conscience qu\'une entente cordiale contribue à un meilleur séjour pour tous.'),
	(460,1,1,'2015-09-04 11:39:38','2015-09-04 11:48:00',842,84,'Calme , discret. Adlane a su trouver sa place au sein du groupe. Très vif et sportif. Difficile voir impossible d\'établir un échange. RAS positif +'),
	(461,1,1,'2015-09-04 11:54:25','2015-09-04 11:54:25',861,84,'Profil que l\'on souhaiterait voir généraliser à tout les autres jeunes. Serviable, gentille attentionnée.  A  l\'aise dans le groupe. Un peu discrète. RAS positif ++'),
	(462,1,1,'2015-09-04 11:55:36','2015-09-04 11:55:36',866,84,'RAS positif +'),
	(463,1,1,'2015-09-04 11:56:34','2015-09-04 11:56:34',867,84,'RAS positif  +'),
	(464,1,1,'2015-09-04 12:09:26','2015-09-04 12:23:42',46,84,'Difficultés avec autrui notamment  les autres jeunes. Peu passer de l\'amusement à de la colère subite. Un effort de sa part pour pacifier ses rapports avec sa sœur on été remarqué.  Demande de l\'attention et de l\'écoute.  Etre attentif et vif pour désamorcer au plus vite ses excès d\'humeur et désacraliser ou relativiser ce qu\'elle considère comme pouvant justifier ses réactions disproportionnées.  A conscience de sa difficulté, donne l\'impression d\'en souffrir. RAS positif.'),
	(465,1,1,'2015-09-04 12:34:30','2015-09-04 12:34:30',874,84,'Mure, posée et réfléchie. Sait réfléchir et dispose d\'un libre arbitre (ne se laisse pas influencer).  Bonne participation au projet d\'animation , curieuse. Très bon rapport avec l\'équipe d\'accueil et le reste du groupe. Bonne participation à la vie quotidienne. Aurait bien souhait rester quelques semaines de plus sur le séjour. Profil qu\'on voudrait bien voir généraliser à l\'ensemble des jeunes.  Très peu de rapport avec son frère Fabala. RAS positif ++'),
	(466,1,1,'2015-09-04 12:38:51','2015-09-04 12:38:51',875,84,'Sportif et participatif. Bonne intégration au sein du groupe.  A quand même asséné un coup à un camarade lors d\'une dispute. Le bilan reste néanmoins très bon. RAS  positif +'),
	(467,1,1,'2015-09-04 12:39:37','2015-09-04 12:39:37',895,84,'RAS positif +'),
	(468,1,1,'2015-09-04 12:40:09','2015-09-04 12:40:09',896,84,'RAS positif +'),
	(469,1,1,'2015-09-04 12:47:59','2015-09-04 12:58:29',901,84,'Posée , réfléchie, curieuse. Un peu en décalée par rapport au autres jeunes ( ex : ne supporte pas le bruit à table, le chahut , les conflits, les enfantillages, la gène occasionnée par des discussions tardives des autres jeunes le soir dans les chambres). Beaucoup d\'intérêt à ce qu\'elle fait ou confectionne. En recherche de discussion avec l\'adulte.  Un profil qui pourrait permettre de mettre en place des projets d\'animation plus culturel par ex. RAS très positif ++'),
	(470,1,1,'2015-09-04 13:03:00','2015-09-04 13:03:00',699,84,'Aucune difficultés. Beaucoup trop d\'appel persistant de sa mère qu\'il a fallu réfréner. Marvin reste demandeur de ces appels.  RAS positif +'),
	(471,1,1,'2015-09-04 13:18:35','2015-09-04 13:18:35',476,84,'Grandes difficultés d\'intégration dans le groupe. Souvent rejeté. Cela l\'amène à se rapprocher de l\'équipe d\'accueil et de se valoriser par les taches de la vie quotidienne. Recherche un statut  privilégié. Tendance à une certaine autonomie de circulation dans les espaces ( confidentiel : séjour entaché par une apparition d\'argent non déclarée et d\'une disparition de 10€ de David Mille, retrouvé par se dernier dans son sac  par la suite. Disparition aussi de 105€ de Bappy et 30€ de Lydia !!!....)  Pour le reste RAS positif +'),
	(472,1,1,'2015-09-04 13:35:31','2015-09-04 13:35:31',648,84,'Confirmation du bon choix de séparer la fratrie. Aucun conflit. Inquiétude concernant l\'état de santé (fatigue, cerne, malaise) surtout lors d\'effort physique. Mise en repos obligatoire régulièrement et réveille individualisé. Sylvie dispose pourtant d\'un bon capital dynamique et sportif. Conseil prodigué à la mère d\'une consultation médicale rapide. Sinon séjour très positif'),
	(473,1,1,'2015-09-04 13:38:31','2015-09-04 13:38:31',907,84,'RAS positif +'),
	(474,1,1,'2015-09-04 13:42:16','2015-09-04 13:42:16',920,84,'Participatif, enjoué. Sait profiter de l\'instant présent. Revient de façon répétitif quand il a une idée derrière la tête. Bonne intégration dans la groupe. Séjour entaché par une foulure au pied. RAS positif ++'),
	(475,1,1,'2015-09-04 13:44:01','2015-09-04 13:44:01',758,84,'Discrète (attention de ne pas l\'oublier). RAS positif ++'),
	(476,1,1,'2015-09-04 13:46:06','2015-09-04 13:46:06',375,84,'Très bon séjour et comportement. A dû être reprise une seul fois  pendant le séjour pour désamorcer une colère dont elle a le secret. RAS positif ++'),
	(477,1,1,'2015-09-04 13:47:24','2015-09-04 13:47:24',933,84,'RAS positif +'),
	(478,1,1,'2015-09-04 13:49:37','2015-09-04 13:49:37',557,84,'N\'est pas venu au séjour.'),
	(479,1,1,'2015-09-04 14:03:06','2015-09-04 14:03:06',145,84,'Très sympathique; peu passer d\'un état de jovialité extrême à une grande tristesse. RAS très positif ++'),
	(480,1,1,'2015-09-04 14:27:51','2015-09-04 14:41:43',943,84,'Bonne éducation et bonne éloquence. Mehdi, au vue de son profil et d\'un malaise qu\'il a exprimé, a bénéficié d\'un traitement particulier notamment de son téléphone.  Le nom respect de l\'accord et ses indiscrétions envers les autres jeunes a amené l\'équipe à recentrer Mehdi dans les mesures générales . Cette action  à généré insultes et bousculades envers le Directeur. Jeune fumeur une gestion drastique, contrôlé et réduite à permis de pacifier les rapports. Mehdi a là respecté ses engagements de discrétion. Dommage qu\'il (selon les dires d\'un de ses camarades) ai remis la veille de son départ un paquet de Philippe Morris.  Peu revenir sur un de nos séjours sous réserve que ces événements et été repris avec le jeunes qui semble savoir écouter car séjour globalement positif.'),
	(481,1,1,'2015-09-04 14:51:27','2015-09-04 14:51:27',955,84,'Jeunes sans gène. Agace lorsqu\'elle se permet d\'ouvrir les chambres des animateurs. Tendance à s\'éclipser sans prévenance. Un peu effronté lorsqu\'on la reprend (sans plus).  RAS moyen.'),
	(482,1,1,'2015-09-04 14:56:07','2015-09-04 14:56:49',953,84,'Le beau gosse de service . Aime la présence féminine. Espiègle et petites bêtises qui doivent être repris  mais qui génère rarement de l\'exaspération. Joviale et enjoué. Précieux, prend soin de sa personne.  Bon profil. RAS positif +'),
	(483,1,1,'2015-09-04 15:22:10','2015-09-04 15:38:52',358,84,'Séjour ambigu. Bon début discret de séjour dû peu être au traumatisme qu\'il avait subit ultérieurement (visage tuméfié) Les nombreuses relations que génère Sameer envers les filles dégénère régulièrement en conflit. Il fini toujours par propager des contres vérités qui amène soit à des pleurs soit à des conflits. Régulièrement des restrictions doivent être énoncés pour contrer sa proximité physique avec les filles qui parfois est indécente. Influençable. Lors d\'un conflit avec un autre jeune (Damien) Sameer a, sur le tard, compris que la situation pouvais générer un renvoie si il persistait dans son attitude. Retour sur un séjour prochain à négocier.'),
	(484,1,1,'2015-09-04 15:44:17','2015-09-04 15:44:17',591,84,'Jeunes discret et inexpressif. Influençable (attitude lors du coucher Damien). A reprendre sous réserve de revenir sur la soirée du 31/07 au 01/08'),
	(485,1,1,'2015-09-04 15:49:20','2015-09-04 15:49:20',822,84,'RAS positif +'),
	(486,1,1,'2015-09-04 15:51:06','2015-09-04 15:51:06',505,84,'Jovial et enjoué. Quelque moment où la jeunes s\'isole. mais n\'en parle pas. RAS positif +'),
	(487,1,1,'2015-09-04 15:53:21','2015-09-04 15:55:04',869,84,'Un calme olympien. Discret. Jamais de démonstration d\'agacement. Bonne entente avec le groupe. Participatif. Profil agréable RAS positif ++'),
	(488,1,1,'2015-09-04 16:03:31','2015-09-04 16:03:31',899,84,'Expressif, participatif et enjoué. Très poli. En recherche de communication avec l\'adulte. Doit être valorisé. une fratrie avec ses sœurs Coralie et Lucie très unie.  RAS positif ++'),
	(489,1,1,'2015-09-04 16:34:21','2015-09-04 16:34:21',873,84,'Aime s\'amuser et rire lui permettant d\'être à l\'aise dans un groupe. A tendance à réagir avec colère lors de chamailleries avec d\'autres jeunes, surtout les plus jeunes qu\'elle. Moins d\'efforts que sa sœur Gwendoline pour pacifier ses rapports. Le bilan global de son séjour reste néanmoins  très positif. Delphine et agréable et participative même si elle louvoie pour éviter les taches de la vie quotidienne. Elle s\'investie sans compter lorsque l\'on le lui fait remarquer. RAS positif +'),
	(490,1,1,'2015-09-04 17:00:12','2015-09-04 17:36:35',266,84,'Mauvais état d\'esprit. Jeune s\'en limite.  Voir note à l\'attention de l\'ASE de Sevran. Voir fiche enfant - dossier - télécharger fichier \"\"'),
	(491,1,1,'2015-09-04 17:46:03','2015-09-04 17:46:03',170,84,'Discrète et peu expressive. Souvent dans l\'observation. Difficile de savoir si le séjour lui plait. Pas très active.  Difficile de se prononcer c\'est le grand vide. RAS positif'),
	(492,1,1,'2015-09-04 17:50:32','2015-09-04 17:50:32',314,84,'Toujours un peu étrange.  A besoin de calme et aime dessiner. Autonome. Aime sortir du groupe. Globalement le séjour est positif mais le manque de vêture et récurent. RAS positif.'),
	(493,1,1,'2015-09-04 17:53:16','2015-09-04 17:53:16',315,84,'Plus jovial et plus intéressée que son frère Hooker par les projets d\'animation  proposés. Grandes difficultés dû au manque de vêture.\r\nRAS positif +'),
	(494,1,1,'2015-09-04 18:02:36','2015-09-04 18:02:36',647,84,'Même si il s\'est à de rare occasion disputé avec les autres jeunes de son age, son comportement n\'a rien à voir avec celui qu\'il aurait pu avoir avec la présence de sa sœur Sylvie. Le choix de séparer la fratrie a été judicieux. RAS positif +'),
	(495,1,1,'2015-09-04 18:04:31','2015-09-04 18:04:31',649,84,'Adorable.  RAS positif +++'),
	(496,1,1,'2015-09-04 18:05:46','2015-09-04 18:05:46',539,84,'Trop bien  c\'est de la famille'),
	(497,1,1,'2015-09-04 18:10:12','2015-09-04 18:10:12',374,84,'Très bon séjour. Le sans faute évité à cause d\'une altercation avec un autre jeune. Sinon bonne progression. Saad a apparemment compris et mûri.  RAS positif  ++'),
	(498,1,1,'2015-09-04 18:27:15','2015-09-04 18:27:15',877,84,'Trouble du comportement. Colérique. Insultes obscènes et menaces envers les animatrices. Quitte le groupe dès qu\'il est frustré. A traversé une route ce mettant en danger. NPR'),
	(499,1,1,'2015-09-04 18:41:55','2015-09-04 18:44:38',485,84,'Grandes difficultés. Jeunes dans l\'exigence.  Fumeuse ne supportant pas la restriction. Violence dangereuse envers une autre jeune (coup porté avec une grille de four sur la tête intercepté par une animatrice et à traîné la jeune par les cheveux). addict au téléphone portable. A volontairement mis à mal le séjour afin d\'obtenir le renvoie.  Renvoie qu\'elle a fini par obtenir. NPR'),
	(500,1,1,'2015-09-04 18:50:51','2015-09-04 18:50:51',590,84,'Jeune sympathique et jovial. Bien intégré dans le groupe malgré quelques moqueries dû à son handicape.  A fortement agacé une jeune fille pour avoir dit avec insistance qu\'il l\'a trouvé belle. RAS positif ++'),
	(501,1,1,'2015-09-04 18:59:07','2015-09-04 20:12:53',780,84,'Trop souvent en conflit avec les autres jeunes. A giflé un camarade d\'une claque laissant une belle trace de doigt. A dû être extrait de sa chambre car empêche ses camarades de dormir. A dormi à plusieurs reprise près du veilleur de nuit  pour arrêter les conflits.  Circule en autonomie et sans prévenance où bon lui semble. \r\nSe met en danger en grimpant une falaise pour attirer l\'attention. Si l\'attention est porté sur lui, il sait être serviable, agréable, participatif. NPR sur un séjour avec moi ( Lyazid Behlouli )'),
	(502,1,1,'2015-09-04 19:05:46','2015-09-04 19:05:46',853,84,'Jeune sympathique surtout quand on arrive à ouvrir le dialogue.  Participation totale sur tout les projets d\'animation proposés et la vie quotidienne. Un fond gentil et attentionné.  Une extrême sensibilité.  RAS  positif +++++'),
	(503,1,1,'2015-09-04 19:17:40','2015-09-04 19:17:40',863,84,'Retour en séjour gite des cimes après deux ans d\'interruption (cadre  : regroupement de fratrie). Discret et peu expressif.  Voir ténébreux. Ne participe pas beaucoup aux activités, à la vie quotidienne.  N \'a pas posé véritablement de difficultés. Savoir si il a passé une bon séjour reste un mystère. RAS  positif.'),
	(504,1,1,'2015-09-04 19:22:11','2015-09-04 19:50:26',40,84,'Joviale et enjouée. Néanmoins séjour mitigé dans l\'ensemble. Répond et tient tête aux animateurs. Peu se montrer vulgaire et insolente. Tendance à surprotéger sa petite sœur Noelle de façon un peu gauche : T\'es morte si tu l\'embète à nouveau. Cela abouti à des peurs paniques chez les petits.  N\'ayant pour ma part pas eu trop de difficultés avec elle (peut être parce qu\'elle me connait mieux) un séjour d\'une semaine est un peu cours pour une appréciation aiguisée et/ou un travail de fond.  Appréciation global positif malgré l\'avis des animateurs.'),
	(505,1,1,'2015-09-04 19:57:12','2015-09-04 19:57:12',41,84,'Se moque des autres. Se mêle des disputes et envenime la situation. Effronté et prête à répondre.  Son coté sportif a certainement facilité ses relations avec les animateurs.\r\nJ\'espère qu\'elle à apprécié le séjour !'),
	(506,1,1,'2015-09-04 19:59:07','2015-09-04 19:59:07',777,84,'Un petit ange que nous accueillons aussi les weekend avec joie et plaisir.'),
	(507,1,1,'2015-09-04 20:02:33','2015-09-04 20:02:33',930,84,'N\'a pas sa place au sein de notre accueil. Préférer une structure adaptée. Se met en danger car frappe sans raison apparente n\'importe quel autre enfants même grand. Ne semble pas saisir tout ce qu\'on lui dit. NPR'),
	(508,1,1,'2015-09-04 20:06:11','2015-09-04 20:06:11',906,84,'Sympathique et participatif. A demandé de changer de chambre à cause de Rayan Grange et Rayan Chebah. Ce que nous avons fini par faire.  RAS positif +++'),
	(509,1,1,'2015-09-04 20:16:24','2015-09-04 20:16:24',709,84,'Participative  à tous, aimable.  Au vue des événements (perte ressente de sa maman) Nawel n\'a pas semblé trop triste. RAS positif ++'),
	(510,1,1,'2015-09-04 20:23:23','2015-09-04 20:33:27',718,84,'Coutumière du gite surtout en weekend Mélanie a participé  pour la 1ère fois à un séjour extérieur.  L\'accompagnement de Noelle Benhazil sur le même séjour a favorisé sa venue aussi que la présence de 2 autres filles de son age. Mélanie participe de mieux en mieux à la gestion de son problème d\'énurésie et camoufle de moins en moins.  Mélanie quand elle est fatigué ce met à pleurer à chaude larmes. Il ne faut pas hésiter à l\'obliger à dormir ce qui implique un surveillance forte et une présence soutenue jusqu\'à ce qu\'elle s\'endorme.  Elle reste une enfant agréable et joviale.\r\nRAS positif ++'),
	(511,1,1,'2015-09-04 20:57:03','2015-09-04 20:57:03',97,84,'Constant dans le chahut à table. Moqueries envers les autres toujours d\'actualités. Mon intervention avait permis déjà en février 2015 qu\'il ne se fasse pas battre. En avril retrouvé  dans sa chambre avec deux filles. Le nuit du 6  août à 00h15 retrouvé dans la chambre des filles. Ludo enfreint systématiquement les règles malgré ses promesses et nos interdictions formelles. En date du 06/08/15 un ultimatum est posée. Un renvoie est envisagé et sera effectif si il récidive encore.  Appel et alerte auprès de ses éducateurs. Dans un premier temps ludo travestie la réalité et se pose en victime. Il est à noté qu\'il se plaint de l\'absence de ses camarades  qui ne viennent plus en séjours au gite (Valentin et Alexandre ont été exclu pour avoir malmené un autre jeune. Il est vrai que certains jeunes enfreignant trop souvent le cadre se sont vu refusé l\'accès à nos séjours). \r\nLudo reste néanmoins la bienvenue à nos séjours. Il lui faudra accepté notre tolérance qui a baissé'),
	(512,4,4,'2015-09-24 09:52:52','2015-09-24 10:10:41',947,87,'jeune qui se comporte en en \"électron libre\". Peut avoir une attitude à la limite provocatrice (bob, part alors qu\'on l\'appelle - hors conflit, parle en africain, ne bouge pas alors qu\'on lui dde....). On sent que ca peut déborder si il trouve d\'autres jeunes dans la mm dynamique. Il pourrait mettre en grande difficulté une équipe. Trop compliqué. Electrise le groupe. A du mal à entendre l\'autorité féminine. Teste constamment les limites. NPR.'),
	(513,4,4,'2015-09-24 09:58:19','2015-09-24 09:58:19',46,87,'A une attitude qui peut la mettre hors du groupe.  Relation très difficile avec les autres, peut se montrer agressive et rejetante.'),
	(514,4,4,'2015-09-24 10:00:13','2015-09-24 10:00:13',913,87,'jeune sympa. gde difficulté d\'alimentation. A fait une crise d\'angoisse, très forte, à vomir, mal de ventre, oppression... après discussion avec l\'animatrice (Nedjma), il est ressort qu\'il angoissait de la distance d\'avec sa famille. C\'est un copain avec qui il était tjrs (Yanis Rebout). Participatif'),
	(515,4,4,'2015-09-24 10:00:49','2015-09-24 10:00:49',584,87,'Jeune sympa. Il faut une gde vigilence par rapport à ses allergies alimentaires.'),
	(516,4,4,'2015-09-24 10:02:23','2015-09-24 10:02:23',919,87,'Jeune sympa. ras +. N\'a pas suivi l\'autre jeune qui était dans sa chambre et qui avait une démarche limite (Boukari avec une forte personnalité). Respecte le cadre et participe.'),
	(517,4,4,'2015-09-24 10:03:33','2015-09-24 10:03:33',928,87,'renfermée. S\'est fait une amie (très renfermée comme elle). Ne veut pas participer aux activités. Contrairement au précédent séjour, n\'a pas réussi à s\'ouvrir'),
	(518,4,4,'2015-09-24 10:03:49','2015-09-24 10:03:49',801,87,'ras +;'),
	(519,4,4,'2015-09-24 10:04:15','2015-09-24 10:04:15',937,87,'jovial. super sympa. s\'est bien intégré et participe à tout'),
	(520,4,4,'2015-09-24 10:04:59','2015-09-24 10:04:59',936,87,'très renfermée. S\'est fait une amie (Mélodie Lefebvre) très renfermée aussi. Ne veut pas participer aux activités'),
	(521,4,4,'2015-09-24 10:05:47','2015-09-24 10:05:47',948,87,'jeune sympa. Différent de son frère. pas de pb de comportement'),
	(522,4,4,'2015-10-07 17:54:42','2015-10-07 17:54:42',812,86,'pas de relation avec les autres. Dans son monde. Fait constamment des bruits, à table, partout. Ne parle pas bcp. Difficile à créer un lien. Difficultés à comprendre les consignes. Ne participe pas aux jeux. Pas de vraies relations avec les autres jeunes. Ne sait pas se laver. manque d\'autonomie'),
	(523,4,4,'2015-10-07 17:55:28','2015-10-07 17:55:28',811,86,'Assez agité. Prend en charge son petit frère. + de liens avec les adultes et autres jeunes. Parle bcp'),
	(524,4,4,'2015-10-07 17:56:27','2015-10-07 17:56:27',859,86,'Petit mais autonome pour l\'hygiène, gère ses vêtements. Locution difficle avec difficulté à comprendre. Gai'),
	(525,4,4,'2015-10-07 17:57:43','2015-10-07 17:57:43',833,85,'Tristesse au début. Très inquiet. Qd il demande qqchose, larmes facilement présentes. Ne joue pas bcp. Manque de motivation. Ne mange rien (aucun légumes)'),
	(526,4,4,'2015-10-07 18:00:20','2015-10-07 18:00:54',840,85,'Insultes, bcp de cris, très agitée. qd on lui dit qqch / pose de questions -> rigole constamment. Ne joue pas forcément avec les autres. Très ddeuse de calins à tous les moments (à table par ex). Après le contact du vendredi -> pipi dans la journée volontairement.  Se lache  (rote, pète à table). - Fin anticipée du séjour\r\nNPR'),
	(527,4,4,'2015-10-07 18:02:48','2015-10-07 18:02:48',942,85,'Dernière semaine, plus difficile dans les relations avec les autres. + susceptible (peut s\'énerver + facilement aux remarques). Remarque à mettre en lumière avec le groupe qui était particulièrement difficile. Pas motivé pour les jeux'),
	(528,1,1,'2015-10-20 10:45:01','2015-10-20 10:45:01',979,100,'fin anticipée du séjour commencé samedi 17 avec un retour structure le 20/10. Voir note jointe dans la fiche enfant'),
	(529,1,1,'2015-10-20 10:49:23','2015-10-20 23:18:12',975,100,'fin anticipée du séjour commencé le 17/10,\r\nJeune très limite dans son comportement. veut tjrs avoir le dernier mot. Electron libre. A un gros pb avec l\'autorité féminine. Ne veut rien lâcher. Electrise le groupe. demande bcp d\'énergie. se moque méchamment des autres. Cherche systématiquement la confrontation pour finalement cédé. ne respecte pas ses engagements. Il avait été prévenu à plusieurs reprises du risque d\'exclusion, mais ca a été trop compliqué pour lui. S\'est confronté pls fois par jour avec Auriane, à table m\'a parlé très mal, agressivement et insolemment, gros clash.\r\nContact avec la famille d\'accueil : le jeune était inquiet de partir en séjour car avait peur de rater des sélections de foot.\r\nContact Ase : Mme roland\r\nNPR'),
	(530,1,1,'2015-10-26 16:18:22','2015-10-26 16:18:22',780,100,'Très compliqué. Titille les autres sans cesse ce qui engendre un rejet des jeunes, notamment les plus grands. A du mal à respecter les consignes. NPRSE. A mettre sur un groupe des plus jeunes au gite'),
	(531,1,1,'2015-10-26 16:18:32','2015-10-26 16:18:32',953,100,'RAS ++'),
	(532,1,1,'2015-10-26 16:18:53','2015-10-26 16:18:53',753,100,'RAS++. Aime bcp être en cuisine'),
	(533,1,1,'2015-10-26 16:19:54','2015-10-30 15:17:40',754,100,'se bagarre très facile. Veut faire comme les plus grands, notamment dans les bêtises. Influencable. Vigilence.'),
	(534,1,1,'2015-10-26 16:20:32','2015-10-26 16:20:32',526,100,'ras ++'),
	(535,1,1,'2015-10-26 16:21:10','2015-10-26 16:21:10',425,100,'ras ++. a semblé un peu triste.  après discussion, cela semble être des pb à la maison.'),
	(536,1,1,'2015-10-26 16:21:48','2015-10-26 16:21:48',426,100,'ras ++. ne participe pas bcp aux veillées mais semble prendre du plaisir à être présente'),
	(537,1,1,'2015-10-26 16:22:06','2015-10-26 16:22:06',967,100,'ras +'),
	(538,1,1,'2015-10-26 16:24:03','2015-10-26 16:33:20',972,100,'jeune pouvant être très sympathique . Se propose spontanément pour aider. Mais en même temps, peut répondre et être insolent. surtout les 1ers jours, après plus facile. Manifeste la volonté de revenir. A insisté pour fumer, mais on a réussi à tenir'),
	(539,1,1,'2015-10-26 16:24:31','2015-10-26 16:24:31',518,100,'ras +. plus joviale.'),
	(540,1,1,'2015-10-26 16:34:12','2015-10-26 16:34:12',44,100,'Ras +. Amélioration par rapport à l\'énurésie (1 fois)'),
	(541,1,1,'2015-10-26 16:38:34','2015-10-26 16:38:34',974,100,'Ras +. un petit souci avec une  ceinture prise à Angélique retrouvée dans la valise. A fait l\'étonnée.  Peut colporter des rumeurs. Est agréable très participante, notamment aux taches quotidiennes'),
	(542,1,1,'2015-10-26 16:38:53','2015-10-26 16:38:53',557,100,'pas venu'),
	(543,1,1,'2015-10-26 16:39:22','2015-10-26 16:39:22',145,100,'ras +'),
	(544,1,1,'2015-10-26 16:54:20','2015-10-30 15:29:17',958,100,'très compliqué, agité. Pousse les adultes à bout. Répond, insulte, menace. Jeune qui peut être aussi agréable, à vouloir aider, participe aux activités. Le vendredi, appel à la structure. Le chef de service s\'est entretenu avec Rayan.  Promesse de faire des efforts. \r\nAprès le départ de Ryan Grange, petite amélioration. N\'a pas tenu dans la semaine. Conflits systématiques avec les autres. a essayé de voler des affaires des jeunes. A volé une sucette dans Carrefour, m^me pris sur le fait, ment et nie. Dernier jour, grosses insultes vis à vis de chiekna. NPR'),
	(545,1,1,'2015-10-26 16:55:40','2015-10-26 16:55:40',664,100,'RAS +. s\'est détendu au fur et à mesure des vacances. Son papa lui a laissé un message par mon biais (que son fils lui manquait  et qu\'il pensait à lui). Son visage s\'est illuminé d\'un grand sourire.'),
	(546,1,1,'2015-10-26 16:56:50','2015-10-26 16:56:50',980,100,'jeune gentille, agréable mais très angoissée. a parlé à tous (jeunes et anim\") de ses pb.'),
	(547,1,1,'2015-10-26 16:58:05','2015-10-26 16:59:37',679,100,'Ras ++. Est capable de dire qd il a passé une bonne journée, etc (1ère fois). D\'habitude, c\'est plus dans : je rale.\r\njeune capable de prendre ses distances dans les bétises pour ne pas avoir des pb.'),
	(548,1,1,'2015-10-26 17:07:04','2015-10-30 15:26:51',723,100,'Au début, jeune tenant des propos très portés sur le sexe.  Très vulgaire. Influence les autres plus jeunes, chuchote, .... comportement pas franc. Fais bcp référence au cannabis. A du mal à entendre qd on lui dit d\'arrêter. Même qd il est pris sur le fait, ne reconnait pas. Le 25/10, au moment où les portables ont été donnés, il a voulu montrer une vidéo porno à un autre jeune (Rayan chebah, qui était un peu éloigné donc n\'a rien vu), mais un anim\' présent est tout de suite intervenu , Le portable ne lui sera plus redonné jusqu\'au départ.\r\nA la fin du séjour, visage plus éclairé, plus souriant, mais veut tjrs être en autonomie. Manipule tjrs les plus petits'),
	(549,1,1,'2015-10-26 17:07:33','2015-10-30 15:17:19',937,100,'Triste au départ. mais après ++. jovial, bien intégré, rigolo'),
	(550,1,1,'2015-10-30 15:01:11','2015-10-30 15:01:11',472,100,'ras ++'),
	(551,1,1,'2015-10-30 15:01:53','2015-10-30 15:01:53',471,100,'ras ++\r\nde mieux en mieux. Plus ouverte et souriante. Avec sa soeur de meilleures relations'),
	(552,1,1,'2015-10-30 15:06:46','2015-10-30 15:06:46',46,100,'bien intégrée dans  un groupe de filles (discrètes, et plus jeunes) dont elle se posait un peu en chef de file. Toujours difficile dans sa relations aux autres, notamment garçons. Réponses agressives sans raison, mais moins de crises d\'opposition que d\'habitude'),
	(553,1,1,'2015-10-30 15:08:16','2015-10-30 15:08:16',962,100,'jeune très nerveux. peut insulter et clasher très facilement (si on lui parle pas suffisamment calmement par exemple). Gros pb à la frustration'),
	(554,1,1,'2015-10-30 15:09:17','2015-10-30 15:15:00',965,100,'Jeune très compliqué. Fait bcp de bruit, se moque systématiquement des autres, se bagarre quotidiennement, manque de respect vis à vis de l\'adulte, n\'écoute pas les consignes. Malgré de nombreuses discussions, n\'arrive pas à tenir ses engagements. NPRSE'),
	(555,1,1,'2015-10-30 15:10:31','2015-10-30 15:10:31',960,100,'jeune sympa, mais  a du mal à écouter et mettre en pratique les consignes, à du mal à se concentrer. Peut se bagarrer.'),
	(556,1,1,'2015-10-30 15:14:07','2015-10-30 15:14:07',708,100,'Jeune très sympa. Triste au départ. Pensée pour son papa. Jeudi, crise d\'angoisse sur le bateau, suffocation, faisant référence à son papa suite à une blague d\'un plus grand ( : attention on va couleur !). Il s\'est détendu au fur et à mesure du séjour. Aime bcp participer à la préparation des repas.'),
	(557,1,1,'2015-10-30 15:15:12','2015-10-30 15:15:12',558,100,'ras +'),
	(558,1,1,'2015-10-30 15:16:21','2015-10-30 15:16:21',791,100,'ras +. A été fiévreux jeudi soir -->  15 et doliprane, sous surveillance. vendredi léger mal de tête, sinon ok.'),
	(559,1,1,'2015-10-30 15:16:49','2015-10-30 15:16:49',888,100,'ras ++. discrète. A bien profité de ses vacances'),
	(560,1,1,'2015-10-30 15:17:53','2015-10-30 15:17:53',699,100,'pas venu'),
	(561,1,1,'2015-10-30 15:23:57','2015-10-30 15:23:57',983,100,'ras ++. Jeune fragile et  gentil dont les autres peuvent profiter'),
	(562,1,1,'2015-10-30 15:24:51','2015-10-30 15:24:51',982,100,'ras +.   Etre attentif pour respect des règles'),
	(563,1,1,'2015-10-30 15:27:41','2015-10-30 15:27:41',511,100,'s\'est calmé. Ras+.'),
	(564,1,1,'2015-12-09 15:31:21','2015-12-09 15:31:21',697,94,'point au 09/12/2015 avec Mme Genty : jeune sympathique, agréable. Veut se faire plus grand que son âge. Se situe dans la satisfaction immédiate du désir. Très respectueux dans la relation duelle avec l\'adulte mais dérape plus dans sa relation avec des pairs. Pas de violence'),
	(565,1,1,'2015-12-14 16:26:55','2015-12-14 16:26:55',988,97,'le week-end s\'est bien déroulé. Avec un autre jeune de son âge, il était un peu dans la moquerie envers les plus jeunes. Il a participé à tous les temps et on a senti à la fin du week-end qu\'il se détendait et souriait plus facilement.'),
	(566,1,1,'2015-12-22 14:50:51','2015-12-29 09:23:18',984,98,'Sankounba JABBI a été accueilli au Gite des Cimes durant quatre week-ends.\r\nIl s\'est très bien intégré dans les différents groupes et a, nous semble-t-il, investi le Gite. C\'est un jeune très agréable, judicieux, et curieux. Sankounba est respectueux du cadre et des adultes.\r\nIl est partant pour participer à tous les temps, tant pour les activités que ceux de la vie quotidienne. Il a été un moteur dans la mise en place d\'un projet culinaire qu\'il a su mener jusqu\'au bout. Il a également été moteur pour associer les autres jeunes. \r\nSa relation avec les autres jeunes va dépendre de la composition du groupe. Il peut être influençable. Il intervient régulièrement dans les sujets qu\'il ne le concerne pas. Les difficultés dans ses relations avec les autres jeunes se retrouvent fréquemment durant les temps informels.'),
	(567,1,1,'2016-01-26 15:32:28','2016-01-26 15:32:28',971,113,'ras ++'),
	(568,1,1,'2016-01-26 16:25:24','2016-01-26 16:25:24',1006,112,'ras ++. Partant pour tout'),
	(569,1,1,'2016-01-26 16:26:46','2016-01-26 16:27:08',697,112,'tjrs des difficultés quant au respect des consignes. N\'écoute pas. Peut se mettre en danger sans conscience (traversée de route, lancement de bois, ...). Amélioration au niveau de l\'alimentation.\r\nL\'accueil doit être limité aux we'),
	(570,1,1,'2016-01-26 16:28:02','2016-01-26 16:28:41',780,112,'tjrs des difficultés dans le respect des consignes. Difficultés dans la relation avec les autres jeunes - dans son comportement peut s\'attirer des coups.\r\nPeut se mettre à crier sans raison (aussi bien à table qu\'à des moments calmes).'),
	(571,1,1,'2016-01-26 16:28:53','2016-01-26 16:28:53',846,112,'ras++'),
	(572,1,1,'2016-01-26 16:28:58','2016-01-26 16:28:58',845,112,'ras++'),
	(573,1,1,'2016-01-26 16:29:06','2016-01-26 16:29:06',519,112,'ras+'),
	(574,1,1,'2016-01-26 16:30:06','2016-01-26 16:30:06',720,112,'très content de pouvoir aller au ski.\r\nA remettre régulièrement à sa place et redire systématiquement le cadre. Mange goulûment, et bcp+.'),
	(575,1,1,'2016-01-26 16:30:13','2016-01-26 16:30:13',850,112,'ras +'),
	(576,1,1,'2016-02-29 10:38:24','2016-03-14 17:38:27',995,121,'jeune agréable. réservée. Prends du plaisir aux activités meme si au départ elle dit souvent \'non je n\'aime pas\'.\r\nras ++\r\nAu retour, elle m\'a dit qu\'elle voudrait bien vivre au gite.\r\nAu rer, Mme est arrivée avec 45\' de retard. Dès qu\'elle est arrivée, Delphine est refermée, plus un mot, plus un sourire\r\n.Indication à transmettre ? -> Une jeune (15-16 ans) qui accompagnait Mme lui a dit - tu aurais mieux fait de rester-'),
	(577,1,1,'2016-02-29 10:40:53','2016-02-29 10:44:55',1007,121,'jeune agréable, voulant rendre service..partant pour ttes les acti svt raleuse. peut se prendre la tête avec les autres jeunes pour des broutilles (il n\'a pas ddé stp pour prendre l\'eau, par exemple).\r\nN\'hésites pas à rentrer en contact physique avec les autres'),
	(578,1,1,'2016-02-29 10:42:35','2016-03-14 17:39:09',937,121,'petites larmes au départ. Début de séjour réservé, mais s\'ouvre de plus en plus.\r\nqd je lui ai proposé d\'appeler sa maman n\'a pas voulu, mais ensuite ok (la maman n\'était pas là. Il a parlé avec sa soeur).\r\njeune super sympa / partant pour ttes les acti'),
	(579,1,1,'2016-02-29 10:42:48','2016-02-29 10:42:48',852,121,'pas venu.'),
	(580,1,1,'2016-02-29 10:43:43','2016-02-29 10:45:21',6,121,'jeune + mais l\'intensité de sa voix est problématique car créé une tension (aux moments des repas, dans les jeux).\r\npartant pour ttes les acti'),
	(581,1,1,'2016-02-29 10:44:20','2016-02-29 10:44:34',851,121,'jeune ok. partant pour ttes les acti. malade en fin de séjour (gastro / médecin).\r\nSe lève très tot (6h30).'),
	(582,1,1,'2016-02-29 10:47:49','2016-04-01 15:37:05',1011,121,'partant pour ttes les acti / jeune sympa.  Veut faire comme son frère'),
	(583,1,1,'2016-02-29 11:15:31','2016-04-01 15:36:46',1010,121,'jeune sympa / partant pour ttes les acti / pb à la frustation (pour les jeux, veut gagner et peut se fâcher). très brutal avec les autres - ne maîtrise pas sa force.. Qd on le reprend se fâche, car ne semble pas comprendre. Peut envoyer balader les adultes (gérable), mais pas violent. Difficulté dans la relation avec son frère. A l\'impression que son frère le colle tjrs'),
	(584,1,1,'2016-02-29 11:15:53','2016-02-29 11:15:53',684,121,'jeune sympa / partant pour ttes les acti  / réservée mais c\'est ouverte de + en +'),
	(585,1,1,'2016-02-29 11:16:28','2016-02-29 11:16:28',1029,121,'jeune sympa / petite....'),
	(586,1,1,'2016-02-29 11:17:05','2016-02-29 11:17:31',314,121,'A progressé. Réfléchit un peu plus avant de répondre sans cesse aux anim\'.\r\nQd nouveaux anim\' teste\r\nA tapé sa soeur'),
	(587,1,1,'2016-02-29 11:17:20','2016-02-29 11:17:20',315,121,'ras +'),
	(588,1,1,'2016-03-08 11:57:55','2016-03-08 11:57:55',1044,117,'Voir note d\'incident'),
	(589,4,1,'2016-03-08 13:05:50','2016-03-21 19:07:11',1035,117,'Peut exaspérer par la récurrence de ses demandes répétées (nombreuses demandes de contact avec la mère auxquelles nous avons répondu favorablement). Étourdi. Peut être influencé et a du mal à s\'intégrer au groupe. \r\nRefuse l\'autorité mais cède facilement lorsque l\'on hausse le ton (rangement de chambre, débarassage de son assiette et couvert. Vérifier que les demandes sont suivies des faits). Jeune qui sait aussi se faire apprécier par l\'équipe d\'accueil par son questionnement et son attitude candide. A tendance à se dévaloriser. Manque de confiance en lui ( je n\'y arrive pas, je suis nul ). Enfant qui doit être encouragé constamment. A du mal à se positionner. Souvent dans le questionnement mais sait entendre quand on explique.Ex : lors de la 1ère semaine Mehdi a exprimé le souhait qu\'il soit mis fin à son séjour et qu\'il n\'entame pas la 2ème semaine; J \'ai pris attache de lui expliquer que tant qu\'il ne ferait pas le deuil de son retour, ce qui l\'empêchait de profiter pleinement des activités proposées, il resterait en souffrance. Il a été sensible à mon argumentaire et selon ses dires ne regrette pas d\'être resté sur la 2ème semaine. Globalement Mehdi est une jeune qui demande une attention particulière à laquelle l\'adulte doit s\'efforcer de répondre pour qu\'il se sente en sécurité. Globalement Mehdi attire la sympathie.'),
	(590,4,4,'2016-03-08 15:55:02','2016-03-08 15:55:02',984,117,'voir note d\'incident'),
	(591,1,1,'2016-03-09 18:24:21','2016-03-09 18:24:21',1043,117,'Voir note d\'incident'),
	(592,1,1,'2016-03-09 18:25:21','2016-03-09 18:25:21',1055,117,'npr - note d\'incident'),
	(593,4,4,'2016-03-11 11:52:00','2016-03-11 11:52:00',1049,132,'Très moqueur envers les autres jeunes. Difficulté à intégrer les consignes. Peut influencer de manières négatives. Dans l\'ensemble bonne 1ère semaine malgré tout.'),
	(594,4,4,'2016-03-11 12:07:40','2016-03-11 12:12:28',967,132,'Discrète, posée. Dans l\'observation en début de séjour puis plus d\'échanges avec les autres jeunes de son âge. A participé à  tous le programme d\'activité. Bon séjour et bon profil. R.F tel 10/03'),
	(595,4,4,'2016-03-11 12:10:24','2016-03-11 12:10:24',1019,132,'A des difficultés à s\'intégrer au groupe.  Comportement irréprochable.'),
	(596,4,4,'2016-03-11 12:19:38','2016-03-11 12:19:38',1034,132,'Influençable. Bon séjour dans l\'ensemble.'),
	(597,4,4,'2016-03-11 12:45:14','2016-03-11 12:52:32',1035,132,'Actif, difficultés à se poser. Distrait. Parfois enfantin. Difficulté d\'intégration au groupe. Agace parfois par la récurrence de ses requêtes (nombreuse demandes de contact téléphoné avec la mère. Assouvi). A exprimé le souhait de ne pas rester la 2ème semaine. Puis content d\'avoir changé d\'avis (à réussi à faire le deuil de son souhait d\'être chez lui avec sa mère permettant de ainsi de mieux profiter des activités). Jeune intelligent. R.F tél le 09/03'),
	(598,4,1,'2016-03-11 13:09:20','2016-03-14 18:24:23',264,132,'Effronté et rebelle quand on le reprend pour non respect du cadre.  Rigole, provoque. se moque et se sauve quand on le rappel. Bagarreur et parfois violent quand il s\'emporte. A insulté les animateurs. Chute à la patinoire. Intervention du samu et des urgences. Sans dommages hormis un coquard au front. Mère prévenue. Vigilance pour le prochain séjour.'),
	(599,4,4,'2016-03-11 13:15:29','2016-03-11 13:15:29',1038,132,'Posée, sympathique. RAS. Bon séjour et bon profil.'),
	(600,4,4,'2016-03-11 13:19:05','2016-03-11 13:19:05',1039,132,'Une petite tendance à répondre  certains animateurs mais cela n\'entache pas un excellent séjour. bon profil.'),
	(601,1,4,'2016-03-14 16:15:36','2016-03-31 12:56:37',1047,132,'Refuse règles et consignes. Attitude effrontée et moqueur. Trouble les animations et vie quotidienne. Engagements non tenus. Echange avec la mère pour recadrage. Peut injurier.'),
	(602,1,4,'2016-03-14 16:24:41','2016-03-31 13:04:22',1048,132,'Respecte globalement le cadre mais très souvent dans l\'opposition avec l\'adulte. Refus de participer à la vie collective. Nous avons évité les exigences et les contraintes de la vie quotidienne car source de conflit potentiel. Difficulté physique, très peu d\'endurance, certainement dû à sa pathologie, malgré le certificat médical.  A quitté le groupe de canirando et a rejoint seule le lieu de départ, obligeant un animateur à quitter le groupe.  Ski : abandon immédiat.  Ce comportement met en difficulté l\'organisation d\'une activité.\r\n Légère amélioration relationnelle en fin de séjour.'),
	(603,1,1,'2016-03-14 16:31:05','2016-03-14 16:31:05',988,132,'Très actif, souvent dans les histoires,  Peut se battre : retour immédiat au centre suite à une bagarre à la patinoire. A suivre si prochain séjour.'),
	(604,1,1,'2016-03-14 16:31:46','2016-03-14 16:31:46',988,132,'Très actif, souvent dans les histoires,  Peut se battre : retour immédiat au centre suite à une bagarre à la patinoire. A suivre si prochain séjour.'),
	(605,1,1,'2016-03-14 16:40:06','2016-03-14 16:40:06',1023,117,'Jeune sympathique et discret. A spontanément présenté ses excuses pour avoir ri d\'un animateur moqué. A était malade 38° de fièvre pendant 3 jours (intervention tel. du 15).  Bon séjour bon profil.'),
	(606,1,4,'2016-03-14 16:41:21','2016-03-31 11:21:23',518,117,'Perte au début du séjour de la pile d\'une de ses deux oreillettes. Difficultés de les porter. \r\nGriffure sur les deux avant bras :\r\n1er semaine : suite à des commérages entre jeunes .  2ème semaine : impactée par une nouvelle téléphonée de sa famille (son oncle serait ou est en prison). Eviter contact tél. pendant séjour. \r\nA écrit son souhait de se suicider à l\'attention d\'un animateur (Amine D). Un regard bienveillant et attentif devra être portée à Olivia sur les prochains séjours.'),
	(607,1,1,'2016-03-14 16:55:43','2016-03-14 17:08:37',1015,117,'Bon séjour RAS'),
	(608,1,1,'2016-03-14 17:25:53','2016-03-14 17:25:53',1046,117,'Très calme, posé, amicale et agréable.  Souvent fatiguée. Problème pulmonaire. Urgence pour ventoline. A eu besoin de repos pendant le séjour. Bon séjour bon profile.'),
	(609,1,1,'2016-03-14 17:32:12','2016-03-14 17:32:12',982,117,'Chamailleur , parfois bagarreur. Influençable. Peut être source de conflit. Se montre plus grand qu\'il n\'y parait dans ses rapport avec autres jeunes et équipe d\'animation. Amadoué en fin de séjour. Bon séjour bon profil.'),
	(610,1,1,'2016-03-14 17:33:23','2016-03-14 17:33:23',1014,121,'retour anticipé : grande difficulté avec le groupe, peut sauter sur un autre jeune et le chercher sans raison. Insulte également. Devant un refus, fais des crises de nerfs, hurle et tape partout, se roule par terre durant 10-15 minutes.\r\nDe ce fait, il est difficile d\'organiser des act en extérieur avec lui. Demande une patience infinie, pas toujours garante de résultats. Demande aussi une présence adulte pour lui.'),
	(611,1,1,'2016-03-14 17:38:58','2016-03-14 17:38:58',777,121,'ras +. Veut souvent faire le ménage. Fait le bb'),
	(612,1,1,'2016-03-14 17:41:16','2016-03-14 17:41:16',803,121,'Jeune agréable. Partante pour tout. Peut être rejetée par les autres filles de son âge (sur un ou deux jours). L\'équipe a fait un travail pour éviter ca (éclater le groupe à table, parole sur le rejet, chuchotement). Jeune sympa.'),
	(613,1,1,'2016-03-14 17:41:24','2016-03-14 17:42:09',780,117,'Éternellement en recherche de conflit avec les autres jeunes. N\'hésite pas à injurier ce qui amène de l\'animosité envers lui. Progrès depuis le séjour à Bacilly. Fini par écouter. A suivre lors d\'un prochain séjour.'),
	(614,1,1,'2016-03-14 17:41:36','2016-03-14 17:41:36',1018,121,'petite très sympa.... ras++'),
	(615,1,1,'2016-03-14 17:43:12','2016-03-14 17:43:12',935,121,'Amélioration depuis le dernier séjour. Plus calme et plus respectueux du cadre.\r\nLa fin de la semaine a été plus difficile. Kévin commençait à s\'agiter..'),
	(616,1,1,'2016-03-14 17:45:32','2016-03-15 10:41:14',1020,121,'ras ++. Jeune partant pour tout.\r\nRencontré qq pb de vol (a volé dans un magasin + au gite s\'est servi dans les placards).\r\nA surveillé dans les propos qui peuvent engendré des réactions de la part des autres jeunes (-j\'aime pas les noirs....-). J\'ai repris ça avec lui'),
	(617,1,1,'2016-03-14 17:45:51','2016-03-14 17:45:51',1021,121,'ras ++. Jeune agréable, partante pour tout'),
	(618,1,1,'2016-03-14 17:46:16','2016-03-14 17:46:16',1022,121,'ras ++. Jeune partant pour tout'),
	(619,1,1,'2016-03-14 17:46:40','2016-03-14 17:46:40',718,121,'La relation avec Noelle a été moins conflituelle'),
	(620,1,1,'2016-03-14 17:47:48','2016-03-14 17:47:48',1024,121,'Jeune très réservée. Ne veut pas se mettre en avant durant les jeux, peut refuser de participer mais semble prendre du plaisir à regarder.\r\nEn relation duelle, agréable et dans l\'échange.\r\nras ++'),
	(621,1,1,'2016-03-14 17:48:15','2016-03-14 17:48:15',1025,121,'Jeune plus ouverte et extravertie que sa soeur. Participante pour toutes les acti.\r\nras++'),
	(622,1,4,'2016-03-14 17:50:23','2016-03-31 11:35:27',1003,117,'Discret, ne se mêle pas aux autres jeunes. Peut se montrer têtu et lent avant de partir en animation.  S\'isole. Très dispersé. Énurésie récurrente en nuitée et parfois en journée. Besoin d\'accompagnement. Amélioration en 2ème semaine en journée. Peut enclin au sport. Refus ski. \r\nSemble avoir besoin d\'un encadrement spécifique et individualisé.'),
	(623,1,1,'2016-03-14 17:51:12','2016-03-14 17:51:12',971,121,'Pb d\'énurésie diurne et nocturne.\r\njeune agréable, mais garder une vigilance - enfant qui peut faire des petites bêtises.\r\nA l\'arrivée, Mme est venue avec 1h30 de retard. Ce sont le papa et tonton qui ont déposé le jeune à crépy.\r\nAu retour, Mme ponctuelle'),
	(624,1,4,'2016-03-14 18:07:57','2016-03-31 10:53:37',679,117,'1ère semaine :   Transgressif quant aux règles. Kleyton rentre la nuit dans la chambre des filles. Un animateur dormant dans le couloir ne l\'a pas dissuadé de nouvelle tentative.  2éme semaine : Kleyton a du se laisser influencé par un autre adolescent particulièrement en opposition avec l\'adulte. Le renvoi de ce dernier a permis de revenir à de meilleurs échanges. Ne heurte  plus physiquement son  jeune frère Reyen. Se montre même très protecteur. Kleyton grandit est semble vouloir se confronter ou s\'affirmer physiquement avec l\'adulte. Vigilance pour le prochain séjour.'),
	(625,1,1,'2016-03-14 18:12:31','2016-03-21 18:17:52',754,117,'1ère semaine : Bon séjour dans l\'ensemble malgré une tendance à l\'impulsivité envers les autres jeunes.  2ème semaine :  Plus de bagarre et toujours de bon prétexte. Souvent dans les histoires. Peu être meneur dans un groupe. Impulsif mais sensible ( peut pleurer facilement) A suivre lors d\'un prochain séjour.'),
	(626,1,1,'2016-03-14 18:16:33','2016-03-21 18:28:07',753,117,'Bon séjour mais rester vigilent car conflit physique possible avec autres jeunes.  2ème semaine : Prompt à la dispute mais reste curieux (s\'intéresse à plein de choses). Participatif active en animation et souvent volontaire dans la vie quotidienne. L\'aider à pacifier ses rapport avec les autres jeunes. A suivre lors d\'un prochain séjour.'),
	(627,1,1,'2016-03-14 18:22:03','2016-03-14 18:22:40',1006,117,'Un peu chamailleur, souvent dans les histoires. Bon respect des consignes de sécurité au ski. Bonne participation à la vie quotidienne.'),
	(628,1,4,'2016-03-14 18:30:33','2016-03-31 11:08:06',680,117,'1ère semaine : S\'intègre facilement au groupe. Un peu influençable et provocateur vis à vis des autres jeunes. Peut aller au conflit physique.  2ème semaine : A attisé une situation conflictuelle entre jeunes  (Sifeddine vs Brad/ Dan).  Prévoir d\'amener le jeune à mieux gérer avec les autres jeunes les tensions que peuvent générer la vie en collectivité. Se sent protégé par son frère. Envisager des séjour séparés ?. Néanmoins bon séjour. Reyen reste très exigeant et critique sur la qualité et ambiance des séjours. Quelque problème d\'énurésie nocturne mais bien moindre que lors des précédents séjours.'),
	(629,1,1,'2016-03-14 18:35:42','2016-03-14 18:35:42',384,117,'Comportement jovial. Un peu étourdie, dissipé, manque de concentration ?  Très participatif. Bon séjour bon profil.'),
	(630,1,1,'2016-03-14 18:39:04','2016-03-14 18:39:04',417,117,'Attirance envers les jeunes filles plus âgées. Moins de conflit avec sa sœur. Bon séjour bon profil.'),
	(631,1,1,'2016-03-14 18:43:26','2016-03-14 18:43:26',418,117,'Peut bouder facilement suite à de petites contrariété. Énurésie mais sait organiser et ou interpeller pour gérer les situation de façon ordonné et discrète. Bon séjour bon profil'),
	(632,1,1,'2016-03-14 18:49:18','2016-03-14 18:49:18',739,117,'A participé à moqueries et insultes sur animateur qui conduisait. A su spontanément et sans demande de notre part s\'excuser auprès de l\'animateur concerné. Parfois limite dans son rapport avec l\'adulte Nordine sait cependant entendre et faire amande honorable. Bon séjour.'),
	(633,1,1,'2016-03-14 18:55:51','2016-03-14 18:55:51',740,117,'Très active. A la limite du non respect envers l\'adulte. Difficulté à se poser mais à su ne pas franchir les limites. Intervention en amont du séjour avec son éducatrice pour prévenance de comportement correcte exigée (mauvais séjour de ski février 2015). A continuer à travailler.'),
	(634,1,1,'2016-03-14 19:07:20','2016-03-14 19:07:20',1037,117,'Étourdie et infantile. Aime à être leader, S\'impose comme chef mais crée par sa manière de faire conflit. Prompt à la bagarre.  Ecoute peu et peu envoyer paître les adultes. Effronté. Désacralisation d\'une situation belliqueuses (au bout de 2 heures) avec 2 autres jeunes.  A fini par entendre raison. Jeunes difficiles mais doit avoir une autre opportunité de séjour au gite sous condition.'),
	(635,1,1,'2016-03-14 19:11:51','2016-03-14 19:11:51',46,117,'Rapport toujours aussi difficile avec les autres jeunes filles de son âge. Nombreux conflits à désamorcer. Entorse à la cheville est venue entacher son séjour ski. Bon séjour bon profil'),
	(636,1,1,'2016-03-14 19:12:53','2016-03-14 19:12:53',801,117,'Sympathique et enjoué. Bon séjour bon profil'),
	(637,1,1,'2016-03-21 15:49:15','2016-03-21 15:49:15',977,117,'Jeune discret et en retrait. Echange inexistant si on ne va pas vers lui. Participatif mais pas volontaire. Aucun refus quand on le sollicite pour les taches de la vie quotidienne. Ordonné. Adore skier et a fini par se décontracter en fin de séjour (esquisse de sourire). Ne côtoies pas les autres adolescents.  Bon séjour bon profil.'),
	(638,1,1,'2016-03-21 17:19:25','2016-03-21 17:19:25',365,117,'Très discrète. Profil très sympathique.'),
	(639,1,1,'2016-03-21 17:27:40','2016-03-21 17:27:40',536,117,'Adorable, enjoué. Bien que participative, le regroupement de la fratrie de quatre n\'étant plus un impératif (2X2) Jessina ainsi que sa sœur Jessica auraient mieux trouver leur place au Gite de bonneuil avec des plus jeunes.'),
	(640,1,1,'2016-03-21 17:31:05','2016-03-21 17:31:05',471,117,'Souriante et sympathique. Très participative tant au animation qu\'à la vie quotidienne. Très triste de devoir quitter le séjour. Séjour ski totalement adapté. Bonne progression.'),
	(641,1,1,'2016-03-21 17:33:39','2016-03-21 17:33:39',472,117,'Poli, serviable, souriante, participative. Très triste de devoir quitter le séjour. Séjour ski totalement adapté.'),
	(642,1,1,'2016-03-21 17:39:25','2016-03-21 17:39:25',699,117,'Stable et inchangé, très décontracté comme à son accoutumé. Le mystère Marvin demeure. Dit être satisfait du séjour quand on lui demande. Toujours beaucoup d\'appel de sa maman néanmoins Marvin m\'a semblé écourté plus facilement ses communications.'),
	(643,1,1,'2016-03-21 17:50:05','2016-03-21 18:12:02',519,117,'Peut ne pas écouter et en faire à sa tête. Oblige à feindre la colère ou de menace de sévir pour qu\'elle écoute. Peu adepter une résistance passive. Difficulté parfois à respecter les consignes. Difficulté relationnelle avec les autres filles plus jeunes. Recherche la présence des garçons plus âgé. Fatima reste très participative aux animations et se montre agréable. Demande beaucoup d\'attention.'),
	(644,1,1,'2016-03-21 18:22:33','2016-03-21 18:22:33',1027,117,'Peu se montrer effronté. Veut se valoriser en adoptant une attitude de grand. Champion de la justification de ses agissements. Se mêle de tout (surtout des autres conflit). Amélioration en cours de séjour. Reste jeune sympathique.'),
	(645,1,1,'2016-03-21 18:42:40','2016-03-21 18:42:40',720,117,'Bonne surprise. Damien pour un premier séjour extérieur s\'est montré sociable enjoué et participatif. Aucun conflit avec d\'autre jeunes à signaler. Enfant physique et plein d\'énergie. Petit bémol : à tendance à se décourager et se dévaloriser lors qu\'il est en échec. Nécessite de l\'encouragement et de l\'attention. Bon séjour bon profil. Bonne évolution positive au regard des 1er week-end accueilli.'),
	(646,1,1,'2016-03-21 18:47:29','2016-03-21 18:47:29',558,117,'Séjour positif dans l\'ensemble et bonne implication dans les animations et la vie quotidienne. Jeunes très sensible à la valorisation. Quelque conflit du à une tendances à la moquerie mais bonne évolution pendant le séjour.'),
	(647,1,1,'2016-03-21 18:49:56','2016-03-21 18:49:56',1032,117,'Très dynamique et énergique. Semble avoir quelques difficultés de concentration. Bon séjour bon profil'),
	(648,1,1,'2016-03-21 18:56:30','2016-03-21 19:02:08',833,117,'Très bon début de séjour. Demande fréquente de contacte avec sa famille au quelle nous avons répondu. Fin de séjour entaché d\'une bagarre pour des raisons de moqueries.  Alexis s\'est montré alors très belliqueux.'),
	(649,1,1,'2016-03-21 19:07:58','2016-03-21 19:07:58',1040,117,'N\'est pas venu au séjour.'),
	(650,1,1,'2016-03-21 19:11:12','2016-03-21 19:11:12',1041,117,'N\'est pas venu au séjour'),
	(651,1,1,'2016-03-21 19:14:41','2016-03-21 19:14:41',1042,117,'Sympathique, a l\'aise avec les plus grands. Participatif. Très calme mais sait s\'imposer quand il le faut. Bon séjour bon profil.'),
	(652,1,1,'2016-03-21 19:18:45','2016-03-21 19:18:45',700,117,'Agréable surprise. Quasiment moins de conflit. Participatif dans la vie quotidienne et demandeur d\'animation. Son problème d\'énurésie semble terminé.'),
	(653,1,1,'2016-03-21 19:34:55','2016-03-21 19:34:55',1049,117,'Jeune sympathique mais à besoin régulièrement de recadrage ferme et non négociable. A du répondant et un bon phrasé. Tendances à se moquer des autres jeunes ce qui peu s\'expliquer certainement par un manque de confiance en lui et/ou au moquerie qu\'il subi. Peu braver l\'autorité mais comprend après discussion. S\'est amélioré au cour du séjour. A éprouvé de la peine à quitter le séjour.'),
	(654,1,1,'2016-03-21 19:37:24','2016-03-21 19:37:24',980,117,'Sympathique. Très attirée par les garçons. Jeune à surveiller, peu se mettre en danger. Sinon bon séjour bon profil.'),
	(655,1,1,'2016-03-21 19:42:46','2016-03-21 19:42:46',1052,117,'Provocateur. Très limite dans ses rapports avec l\'adultes. Ne pas céder, rester stricte. Cadrage obligatoire et nécessaire. A participé à la mise en difficulté de l\'équipe d\'accueil. Calme obtenu après le renvoie d\'un camarade de chambre. NPR'),
	(656,1,1,'2016-03-21 19:47:36','2016-03-21 19:47:52',1053,117,'A déclenché à l\'aide d\'un spray l\'alarme incendie. A accepté la sanction ( vaisselle et rangement pour réparé ). A frappé le petit Damien qui l\'aurai bousculé et fait tomber son téléphone (sauf que ce n\'était pas Damien). Difficulté à s\'excuser.  A surveiller lors d\'un prochain séjour.'),
	(657,1,1,'2016-04-12 15:09:39','2016-04-12 15:09:39',1079,133,'Enurétique se montrer discret. 1er colo. Donner duvet'),
	(658,1,1,'2016-04-27 14:45:12','2016-04-27 14:45:12',384,134,'ras + tjrs souriant / participant a tous les temps'),
	(659,1,1,'2016-04-27 14:46:33','2016-04-27 14:46:33',833,134,'Ras +  / a ddé à téléphoner à ses parents et à la suite a eu un temps de tristesse / participe à ts les temps de la vie / tjrs un pb pour manger'),
	(660,1,1,'2016-04-27 14:47:18','2016-04-27 14:47:18',783,134,'ras + / participe à ts les temps / aime aider durant la vie quot\" / agréable'),
	(661,1,1,'2016-04-27 14:50:42','2016-04-27 14:50:42',1045,134,'séjour difficile / a du mal dans la relation aux autres / se victimise systématiquement :  avec les autres jeunes, les cherche, peut générer des conflits et ne veut pas reconnaitre sa part de responsabilité / avec les adultes : a du mal avec la frustration et peut faire mine de partir, peut s\'énerver. / dde une attention, \r\nSi prochaine inscription, préférer le gite'),
	(662,1,1,'2016-04-27 14:51:07','2016-04-27 14:51:07',1034,134,'Ras + / jeune agréable / participe à toutes les activités'),
	(663,1,1,'2016-04-27 14:51:48','2016-04-27 14:51:48',314,134,'ras + / a été très proche des plus grandes filles / moins de conflits avec les adultes'),
