	(672,1,1,'2016-04-27 15:05:45','2016-04-27 15:05:45',366,129,'adorable  / participe à tous les temps  / veut tjrs aider (donc à limiter gentiment dans son implication à la vie quoti / bien intégrée dans le groupe'),
	(673,1,1,'2016-04-27 15:08:35','2016-04-27 15:08:35',961,129,'jeune qui demande une attention et un cadre : il a systématiquement un petit mot désagréable ou moqueur au cours d\'un échange (meme qd les anim\' disent / reprennent qqchose). A du mal à laisser le dernier mot.\r\nSur un prochain séjour, préférer le gite'),
	(674,1,1,'2016-04-27 15:09:56','2016-04-27 15:09:56',1078,129,'ras +, jeune agréable / a été malade, mme n\'a pas remboursé et me retourne vers M. Sahui. dû 29 € (feuille de soins pour remboursement donnée)'),
	(675,1,1,'2016-04-27 15:11:32','2016-04-27 15:11:32',1007,129,'ras + / a été attirée vers les plus grandes? A du mal à entendre les remontrances / \"raleuse\" mais néanmoins sympathique / participe aux acti\''),
	(676,1,1,'2016-04-27 15:24:04','2016-04-27 15:33:45',967,129,'ras + / agréable, tjrs un peu renfermée / a pleuré après avoir eu son père qui lui a annoncé qu\'ils ne pourraient pas se revoir bientôt / bien intégrée au groupe / La 1ere semaine, s\'est tenue à l\'écart des histoires. Par contre pour la 2ème semaine : difficultés rencontrées avec un groupe de filles (dont elle) qui se sont groupées contre une autre. Sessilina étant une jeune présente dans le groupe, riant avec les autres des moqueries mais sans en surajouter. Le groupe faisant les moqueries et allusions méchantes (thon, etc pour finir à \'pute\').\r\nOn a repris ca à plusieurs reprises, en groupe et individuellement. Le lundi soir à 00h30, 4 gdes ont fait le bazar dans le dortoir, propos sur les anim\' qui ont dépassé l\'acceptable. Rando pour rafraichir les idées. Le lendemain se passe mieux (mesures de séparation à table du groupe concerné),  jsqu\'au retour de Rachid qui recommence la médisance contre Lauryne. Grande fermeté et sévérité de l\'équipe. Mise à l\'écart par l\'équipe du jeune. le soir et mercredi nette amélioration. Les relations redeviennent normales.'),
	(677,1,1,'2016-04-27 15:38:39','2016-04-27 15:38:39',1084,129,'jeune agréable, leader, forte personnalité.  La 1ere semaine, était au coeur des histoires, ce qui lui a meme fait dire au moment du bilan de la 1er sem, que son séjour avait été entaché par les \'histoires\".  Peut tenir des propos à connotation sexuelle un peu déplacés et sans prise en considération de la présence des plus jeunes. L\'équipe a été obligée de poser un interdit par rapport à ces propos.\r\nPar contre pour la 2ème semaine : difficultés rencontrées avec un groupe de filles (dont elle) qui se sont groupées contre une autre. Le groupe faisant les moqueries et allusions méchantes (thon, etc pour finir à \'pute\').\r\nOn a repris ca à plusieurs reprises, en groupe et individuellement. Le lundi soir à 00h30, 4 gdes ont fait le bazar dans le dortoir, propos sur les anim\' qui ont dépassé l\'acceptable. Rando pour rafraichir les idées. Le lendemain se passe mieux (mesures de séparation à table du groupe concerné),  jsqu\'au retour de Rachid qui recommence la médisance contre Lauryne. Grande fermeté et sévérité de l\'équipe. Mise à l\'écart par l\'équipe du jeune. Dominique est venue me parler pour s\'excuser et s\'engager à des efforts. le soir et mercredi nette amélioration. Les relations redeviennent normales.'),
	(678,1,1,'2016-04-27 15:44:06','2016-04-27 15:44:06',299,129,'jeune agréable, fait beaucoup plus grande de son âge, se met avec les plus âges et adopte un comportement qui dépasse son âge.  Peut se mettre en scène, se mettre en colère, gesticuler devant des interdits.\r\n La 1ere semaine, était au coeur des histoires, ce qui lui a meme fait dire au moment du bilan de la 1er sem, que son séjour avait été entaché par les \'histoires\".  Peut tenir des propos à connotation sexuelle un peu déplacés et sans prise en considération de la présence des plus jeunes. L\'équipe a été obligée de poser un interdit par rapport à ces propos.\r\nPar contre pour la 2ème semaine : difficultés rencontrées avec un groupe de filles (dont elle) qui se sont groupées contre une autre. Le groupe faisant les moqueries et allusions méchantes (thon, etc pour finir à \'pute\'). S\'est maquillée bcp trop, j\'ai donc posé un interdit sur le maquillage pour les moins de 15 ans.\r\nOn a repris ca à plusieurs reprises, en groupe et individuellement. Le lundi soir à 00h30, 4 gdes ont fait le bazar dans le dortoir, propos sur les anim\' qui ont dépassé l\'acceptable. Rando pour rafraichir les idées. Le lendemain se passe mieux (mesures de séparation à table du groupe concerné),  jsqu\'au retour de Rachid qui recommence la médisance contre Lauryne. Grande fermeté et sévérité de l\'équipe. Mise à l\'écart par l\'équipe du jeune. Dominique est venue me parler pour s\'excuser et s\'engager à des efforts. le soir et mercredi nette amélioration. Les relations redeviennent normales.'),
	(679,1,1,'2016-04-27 15:44:45','2016-04-27 15:45:28',892,129,'jeune adorable / très gentil. Très distrait / est dans son monde.'),
	(680,1,1,'2016-04-27 15:46:59','2016-04-27 15:46:59',1086,129,'ras + / jeune agréable.'),
	(681,1,1,'2016-04-27 15:47:45','2016-04-27 15:47:45',83,129,'ras + / tjs agréable. Sait se tenir à l\'écart des histoires.'),
	(682,1,1,'2016-04-27 15:49:57','2016-04-27 15:49:57',664,129,'bon comportement la 1er semaine / la 2ème s\'est laissé influencé par un groupe de filles moqueuses qui se sont coalisées contre une autre. Sait entendre qd on reprend ca avec lui.'),
	(683,1,1,'2016-04-27 15:52:50','2016-04-27 15:52:50',1104,129,'jeune sympathique en relation avec l\'adulte. A des difficultés dans sa relation avec les autres. Suscite la moquerie, en rit mais après ca dégénère et peut en venir aux mains. Ne reconnait pas sa responsabilité dans les pb. Est très maladroit dans ses actes. Son papa a pris régulièrement de ses nouvelles.\r\nSi réinscription, lui préférer le gite. \r\nA cassé un lit en sautant dessus.\r\nvigilance sur l\'hygiène'),
	(684,1,1,'2016-04-27 15:55:39','2016-04-27 15:57:51',1010,129,'ras + / jeune agréable / le séjour s\'est mieux déroulé que le précédent au regard de sa brutalité.\r\ns\'est bien intégré au groupe des plus grands. Le fait que le groupe soit plus important lui a permis de se distancier de Khajik qui insiste malgré tout à certains moments pour être présent à côté de son frère (notamment lors des repas), ce qui engendre de la colère de Levon.'),
	(685,1,1,'2016-04-27 15:57:28','2016-04-27 15:57:28',1011,129,'jeune sympa / veut être son gd frère mm si ce dernier ne veut pas de sa présence. Qd on lui explique que Levon veut être seul avec les plus grands lors des repas, il semble de ne pas comprendre pourquoi. j\'ai été obligée d\'exiger qu\'il mange avec les jeunes de son âge.\r\nparticipe à tous les temps.\r\nras +'),
	(686,1,1,'2016-04-27 16:02:49','2016-04-27 17:00:30',738,129,'jeune agréable..\r\n La 1ere semaine, était en retrait par rapport aux autres filles. Peut se tenir à l\'écart. A du mal à participer aux activités, préfère rester en retrait, et meme rester avec les plus jeunes, ce qui n\'a pas été le cas pour la 2eme semaine.\r\nPar contre pour la 2ème semaine : difficultés rencontrées avec un groupe de filles (dont elle faisait partie ponctuellement) qui se sont groupées contre une autre. Le groupe faisant les moqueries et allusions méchantes (thon, etc pour finir à \'pute\'). Lors des reprises avec l\'équipe, a pu se montrer un peu insolente, ce qui nous a surpris car ce n\'était pas du tout son comportement de la 1ere semaine. \r\nOn a repris ca à plusieurs reprises, en groupe et individuellement. Elle a entendu les arguments et l\'appel à la raison. A été une des premières a cessé les moqueries et son comportement s\'est nettement amélioré.'),
	(687,1,1,'2016-04-27 16:04:05','2016-04-27 16:04:05',760,129,'ras + / un peu dans la lune. pb d\'énurésie moins importants mais qd mm présents. Faire attention car a tendance à cacher et préfère mentir.'),
	(688,1,1,'2016-04-27 16:05:43','2016-04-27 16:05:43',1105,129,'ras + / jeune gentil et agréable. Réservé. Participe à tous les temps des activités. Est tombé lors d\'une sortie vélo. Radio -> index félé, 10 j d\'attèle.'),
	(689,1,1,'2016-04-27 16:10:48','2016-04-27 16:10:48',1111,129,'jeune plus âgé que son âge \'officiel\'. Peut avoir des gestes violents retenus (avec les plus jeunes, sur les objets). C\'est un jeun qui peut être agréable dans la relation avec l\'adulte. Manie l\'autodérision et l\'humour. Se comporte en électron libre. A du mal à respecter les consignes. On sent qu\'en cas de confrontation, on pourrait être perdants. Si en présence d\'autres garçons plus compliqués que ceux du séjour je pense qu\'on n\'arriverait pas gérer. Là il était tjrs avec Christian qui l\'a posé car très calme et dans la retenue. NPR.'),
	(690,1,1,'2016-04-27 16:14:39','2016-04-27 16:14:39',1108,129,'jeune extra ++ / mature / respectueuse. Réservée mais capable de se lier aux autres. A souffert des histoires régnant dans la colo. Veut tjrs aider. \r\nA des difficultés sur les acti sportives.\r\nTrès agréable dans sa relation avec l\'adulte. lLa 1er semaine était avec Gloria et a 2ème semaine, S\'est bien entendu avec Chloé.\r\nA échangé avec l\'équipe autour de ses difficultés, notamment familiales.'),
	(691,1,1,'2016-04-27 16:20:34','2016-04-27 16:20:34',740,129,'Jeune dont le comportement n\'est pas celui du séjour ski auquel participait également son frère.\r\nPeut avoir des propos à connotation sexuelle déplacées. A cherché à séduire les anim\' au début. Peut se mettre en scène, gesticuler, crier, ne pas vouloir entendre. Ne voulait pas repartir, a caché sa valise pour mettre en difficulté le départ. M\'a reproché de ne pas avoir organisé la prolongation de son séjour. \r\nFrais médicaux avancée : 33, 93 € non remboursés par M. \r\nLe retour a été très compliqué : le papa n\'est pas venu la récupérer (très agressif au téléphone). Appel astreinte qui n\'a rien pu faire, déplacement au commissariat d\'aulnay qui n\'a pas voulu prendre en charge la jeune. Finalement 2h30 plus tard, appel taxi pour être déposée chez l\'amie du père (25 € à faire rembourser).'),
	(692,1,1,'2016-04-27 16:26:04','2016-04-27 16:27:33',853,129,'très sympa et gentille / participe et est partante pour tout /  se maquille de façon très voyante, voire un peu vulgaire. A souffert des moqueries sournoises de certaines autres filles (un groupe de 4/5 jeunes). Etait prête à en découdre physiquement. \r\nLe groupe faisant les moqueries et allusions méchantes (thon, etc pour finir à \'pute\').\r\nOn a repris ca à plusieurs reprises, en groupe et individuellement. Le mardi se passe mieux (mesures de séparation à table du groupe concerné),  jsqu\'au retour de Rachid qui recommence la médisance contre Lauryne. Grande fermeté et sévérité de l\'équipe. Mise à l\'écart par l\'équipe du jeune. Le soir et mercredi nette amélioration. Les relations redeviennent normales. \r\nLes premiers jours, a eu du mal à trouver sa place. Au vu de quoi J\'ai permis à Lauryne d\'intégrer le groupe Equitation certains jours, en fonction des activités proposées.'),
	(693,1,1,'2016-04-27 16:28:12','2016-04-27 16:28:12',1069,129,'jeune agréable mais qui peut avoir des gestes brutaux. Etre attentif'),
	(694,1,1,'2016-04-27 16:28:59','2016-04-27 16:28:59',1081,129,'jeune très réservé vis à vis de l\'adulte. bien intégré dans le groupe de jeunes'),
	(695,1,1,'2016-04-27 16:29:39','2016-04-27 16:30:38',1082,129,'ras +. Jeune agréable, curieux. Donne l\'impression d\'être plus grand   que son âge dans sa manière de parler, sa réflexion.'),
	(696,1,1,'2016-04-27 16:30:59','2016-04-27 16:30:59',471,129,'ras ++'),
	(697,1,1,'2016-04-27 16:31:14','2016-04-27 16:31:14',472,129,'Ras++'),
	(698,1,1,'2016-04-27 16:31:54','2016-04-27 16:31:54',1034,129,'ras ++ / jeune sympathique et partant pour toutes les activités.'),
	(699,1,1,'2016-04-27 16:32:51','2016-04-27 16:32:51',801,129,'Ras ++ / est mieux intégré dans le groupe que lors des précédents séjours.'),
	(700,1,1,'2016-04-27 16:38:59','2016-04-27 16:38:59',1106,129,'Jeune très agréable / s\'est de plus en plus ouverte / angoissée par moments / on arrive de plus en plus à la comprendre. / n\"hésites pas à dire quand elle commence à ne pas se sentir  mal et à échanger avec les adultes pour expliquer / s\'est bien intégrée au groupe de filles'),
	(701,1,1,'2016-04-27 16:54:54','2016-04-27 16:54:54',833,133,'ras + / voir note Natur&Co 1ere semaine'),
	(702,1,1,'2016-04-27 16:55:03','2016-04-27 16:55:03',364,133,'ras + / voir note Natur&Co 1ere semaine'),
	(703,1,1,'2016-04-27 16:55:11','2016-04-27 16:55:11',366,133,'ras + / voir note Natur&Co 1ere semaine'),
	(704,1,1,'2016-04-27 16:55:25','2016-04-27 16:55:25',1036,133,'pas venue'),
	(705,1,1,'2016-04-27 16:55:38','2016-04-27 16:55:38',1045,133,'voir note Natur&Co 1ere semaine'),
	(706,1,1,'2016-04-27 16:59:11','2016-04-27 16:59:11',1004,133,'jeune agréable. Plus mature que son âge. S\'est intégrée au groupe des plus grandes.\r\nAu début : difficultés rencontrées avec un groupe de filles (dont elle faisait partie ponctuellement) qui se sont groupées contre une autre. Le groupe faisant les moqueries et allusions méchantes (thon, etc pour finir à \'pute\'). \r\nOn a repris ca à plusieurs reprises, en groupe et individuellement. Elle a entendu les arguments et l\'appel à la raison. A été une des premières a cessé les moqueries et son comportement s\'est nettement amélioré.'),
	(707,1,1,'2016-04-27 17:07:52','2016-04-27 17:07:52',953,133,'Difficultés rencontrées avec un groupe de filles (dont il faisait partie) qui se sont groupées contre une autre. Le groupe faisant les moqueries et allusions méchantes (thon, etc pour finir à \'pute\'). On a repris ca à plusieurs reprises, en groupe et individuellement. Le lundi soir à 00h30, 4 gdes ont fait le bazar dans le dortoir, propos sur les anim\' qui ont dépassé l\'acceptable. Rando pour rafraichir les idées. Le lendemain se passe mieux (mesures de séparation à table du groupe concerné), jsqu\'au retour de Rachid qui recommence la médisance contre Lauryne . L\'après midi, il avait été à l\'équitation avec elle et avait fait la démarche pour l\'approcher et obtenir des renseignements sur sa vie. Qd il est revenu, il est donné les informations aux autres filles. Grande fermeté et sévérité de l\'équipe. Mise à l\'écart par l\'équipe du jeune. Le soir et mercredi nette amélioration. Les relations redeviennent normales.'),
	(708,1,1,'2016-04-27 17:10:50','2016-04-27 17:10:50',519,133,'teste le cadre régulièrement. Se positionne en bébé qui ne comprend pas qqfois.  Très envahissante'),
	(709,1,1,'2016-04-27 17:11:16','2016-04-27 17:11:16',46,133,'ras / plus posée que d\'habitude'),
